{"nr_products": 591, "catid": 10, "level": 0, "url": "http://www.target.com/c/baby-baby-bath/-/N-5xtjj", "text": "baby bath", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Bath time can be your baby\u2019s favorite time of the day with the proper preparations. Some say you develop a special bond with your little one as you talk, sing and play with the baby in the tub. If you think your little one is ready for the first bath, get your notepad and list out the things you need. Or, browse through the super fun collections of baby bath accessories available here at Target. We have a whole lot of awesome ideas for new moms to feel comfortable and in control, no matter how squirmy or jumpy your baby gets during bath. Choosing the right bath tub is the key. You\u2019ll find them in a multitude of shapes, colors and designs to meet every need. Cushioned, foldable, inflatable or musical baby bath tubs - you name it, you get it. Boost the fun factor during bath time with bath toys to keep your baby entertained in the water. Your baby can grip, squeeze and toss these bath toys and splash some water around. Target also offers a range of baskets and organizers to store all the toys in one place after bath. Other baby bath items available here include toiletries like shampoos, body wash, sanitizers, body lotion and more from all of your favorite brands. Once out of the tub, pat dry your little one with our super luxurious towels made of the softest fabrics for your baby. These towels come in bright colors and fun designs to choose from. Whether it\u2019s for the first bath or the hundredth, Target has everything you need to make bathing your child super special.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 856, "catid": 11, "level": 0, "url": "http://www.target.com/c/baby-boys-clothing/-/N-5xtjb", "text": "boys\u2019 clothing", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "He\u2019s a growing boy and you love to see him hit those milestones. This means you get to add each season\u2019s latest trends to his wardrobe. Here at Target, you\u2019ll find everything from onesies and playwear to suits and outerwear in styles you and your little guy are going to love. Because your little man is so active, we have a variety of clothes that keep up with him. Target has stylish swim trunks for your future award-winning swimmer, graphic tees, jeans , shorts and more for play dates, school and activities. Our comfy pajama sets are just what he\u2019ll need to end his day in snuggly comfort. Seasons change and so do his clothing needs. Stock up on cold-weather essentials like jackets, sweaters and vests for when there\u2019s a chill in the air and snow on the ground. Or pick up swim suits, sunglasses and tees for warm-weather wear. If you love to dress your toddler in superhero tees or button-down shirts , we have them both. From the basics to the latest, we have exactly what your little boy\u2019s wardrobe needs to be ready for any occasion. Get all this and more from top brands like Circo, Just One You by Carter's and Cherokee. Our cute, cool fashions will keep his wardrobe fresh and functional as he grows up.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 186, "catid": 12, "level": 0, "url": "http://www.target.com/c/baby-boys-shoes/-/N-59aj2", "text": "boys\u2019 shoes", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 1139, "catid": 13, "level": 0, "url": "http://www.target.com/c/baby-girls-clothing/-/N-5xtig", "text": "girls\u2019 clothing", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Shopping for your daughter is one of the added perks of having a little girl. Whether she enjoys ruffles, pastels, bows and flowers or prefers overalls, t-shirts and jeans, you\u2019ll find what you need at Target. Little girls grow so quickly. If it\u2019s time to revamp her wardrobe for the upcoming season or build a new one from scratch, Target has a variety of styles, colors and fashions to keep her wardrobe fun and fresh. You\u2019ll find the nightgowns and pajamas she\u2019ll love snuggling into for bedtime and the play wear that\u2019ll keep her comfy while she\u2019s enjoying herself. Whether your little girl has just opened her eyes for the first time, is beginning to take her first steps or is on the verge of attending her first day of preschool, you\u2019ll find the right clothes to suit her needs. Wondering where to start? Almost every little girl dreams of being a Disney Princess at least once in her life. Let her walk a mile in her favorite Princesses\u2019 shoes by wearing pretty tops, dresses and more decorated with images of the enchanted princesses she adores. Who can resist Hello Kitty ? Whether your child prefers t-shirts or tutus, when she\u2019s sporting Hello Kitty wear she\u2019s sure to make a fashion statement. If you\u2019re on the hunt for the latest trends or basic wardrobe essentials, you\u2019ll find them at Target. Cute styles at sweet prices. What more do you need?", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 280, "catid": 14, "level": 0, "url": "http://www.target.com/c/baby-girls-shoes/-/N-59aiu", "text": "girls\u2019 shoes", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 333, "catid": 15, "level": 0, "url": "http://www.target.com/c/baby-car-seats/-/N-5xtlx", "text": "car seats", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Getting around town is even more exciting with kids. All you need is a perfect car seat to give your little travel companion the comfort she deserves. From infant car seats to convertible car seats and harness boosters, Target has a wide selection of car seats from leading brands like Baby Trend , Evenflo and Graco that are sure to offer peace of mind! Just pick your favorite, buckle up baby and hit the road! Your baby\u2019s day out gets better with our infant car seats. It has everything from a padded seat, canopy, headrest and more to keep your tiny traveler as comfy as he is at home. Some say parenting is difficult, but we say it\u2019s fun (at least when you\u2019re driving)! To make your life easier, most of our infant car seats come with a base and a seat, so you can leave the base in the car and move the seat to a stroller and just keep going! Worried about bumpy rides? Rest easier with reliable harness systems from Target! Your baby grows faster than you can imagine. He may outgrow his clothes, cribs and playards pretty fast, but not our convertible car seats! From an infant and a toddler to a kid, they are made to be a part of every phase of his childhood. And for parents, the convertible car seat is a definite bang for the buck!", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 1047, "catid": 16, "level": 0, "url": "http://www.target.com/c/baby-diapering/-/N-5xtlp", "text": "diapering", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Keeping your baby happy and healthy is a tall order. Target is here to help. We offer everything from disposable and cloth diapers to wipes and warmers to keep your little one comfortable. Use our diaper gear, disposable diapers or go green with cloth diapers - all from top baby-friendly brands like Huggies , Pampers, Dadgear and Eddie Bauer . Our selection of diaper bag backpacks, totes , shoulder bags and more will keep you organized when you\u2019re on the go. Carry an extra change of clothes, diapers, wipes, creams and more wherever you go to keep your baby comfy. Protect your baby and keep surfaces covered with our changing pads, which are available in a variety of convenient sizes. Our changing pads are ideal for quick changes in the car, stroller or public restrooms. We offer diaper pails and refills to keep your nursery clean and odor-free. We also have other items to make diapering quick and easy for you and your little one. Pick up our diaper stackers, creams and more to keep your baby dry and diapering items handy. Shopping at Target helps make parenting a little easier.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 1902, "catid": 17, "level": 0, "url": "http://www.target.com/c/baby-feeding/-/N-5xtl0", "text": "feeding", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "A healthy baby is a happy baby. Your little one will need the right amount of nutrition to play, learn and become an active toddler. And because Target knows breastfeeding is the key to good health, we bring to you an extensive collection of baby feeding accessories. From breast pumps and feeding pillows to baby bottles and highchairs , you can find everything you\u2019ll need to make meal time easy for you and your child. Target offers supplies for both breastfeeding and bottle feeding, including baby formula from top brands like Enfamil and Similac . Baby bottles, warmers and other bottle feeding accessories are also available. When you think your baby is ready for solid foods, Target is here to help you once again. Find cereals, fruit snacks, yogurt, fruit/veggie meals and more to introduce him to tasty and healthy food. Love preparing baby food at home? Our line of food processors including combination blenders, mixing pitchers, food mills and food chopper/steamers will fit the bill. Meal time is not just about food, it\u2019s also about food mess! Pick from our selection of baby bibs and burp cloths for mess-free feeding. Our highchairs and booster seats are available in super-practical designs, so your baby is happy and comfortable.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 569, "catid": 18, "level": 0, "url": "http://www.target.com/c/baby-health-safety/-/N-5xthj", "text": "health & safety", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Motherhood is the biggest, most challenging and most rewarding job ever. At Target, we help you, take care of your MILP (most important little person) from his arrival and beyond. Our baby health and safety department has everything from baby medicine to bed rails for your little guy. Are you ready to start outfitting your home for a new baby? You'll want to have a few child proofing supplies tucked away and ready for his initial \u201cI discovered I can walk\u201d days. We have socket, corner and knob covers to keep your baby safe. Our cabinet locks, toilet seat latches and baby safety gates will keep him where you want him to stay, not the risky places he will want to explore! Baby got a boo boo? Our extensive supply of teething gel, gas drops, pain relief, cold and stuffy nose medicines will help your little one get through his crappy days with a smile. Check out our shopping cart and high chair covers to keep him comfy while protecting him from germs at public places. We've got a collection of fun, fabulous patterns to suit any d\u00e9cor or personality. Wondering what your baby is up to? Try our baby monitors From prenatal monitors to audio, video and internet Wi-fi monitors, we help you keep track of your baby\u2019s every move. Let Target be your partner in child safety. We will supply you with the tools you need to keep your baby healthy and safe!", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 141, "catid": 19, "level": 0, "url": "http://www.target.com/c/baby-infant-carriers/-/N-5q0eu", "text": "infant carriers", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 356, "catid": 20, "level": 0, "url": "http://www.target.com/c/baby-strollers/-/N-5xtk7", "text": "strollers", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Your baby is your world, and now it\u2019s high-time to take him out and show him the outside world. Whether it\u2019s a walk in the park or a stroll down the street, Target knows how to keep your little one comfortable. We have hundreds of baby strollers for a fun and cry-free outing. Whether for a quick pediatrician visit or grocery shopping, just take him with you in our exclusive selection of lightweight strollers. Our double strollers will keep twins inseparable, even outdoors ! Triplets? Our triple strollers are for you. Our full-size baby strollers just grow with your baby and give him the comfort he deserves every time. It has everything from padded seats and headrests to footrests and storage baskets, and what\u2019s more a cup holder to keep his favorite drink within reach. Worried about taking your child outdoors? All our modern strollers have harness systems and lockable wheels to offer fun for your baby and peace of mind for you. Why spend on an additional car seat , when we have travel systems that come with a car seat.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 503, "catid": 21, "level": 0, "url": "http://www.target.com/c/baby-toys-activities/-/N-5xtjv", "text": "toys & activities", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "What\u2019s playtime without baby toys? From infancy to childhood and sometimes even later, toys are a kid\u2019s best friend. They open up a world of imagination. Double up your little one\u2019s playtime fun with the exclusive toy collection available at Target. Whether meek or mischievious, we have toys for every baby. With our huge collection of bouncers and rockers , playtime fun starts from day 1. Few things can fascinate your newborn more than a rattle. To add to the fun, we offer rattles that double as a teether to soothe tender gums. While you need activity toys to entertain during the day time, you\u2019ll simple love our soothers to keep them company at nights. These musical toys play lullabies and make natural sounds to get them ready for bedtime, or a couple of super-soft baby plush toys might do the trick. Babies love playards and playmats , but your toddler may need something more interesting and captivating to explore. And, you\u2019ll want to keep them occupied, too. Let your little adventurer go around the house and explore their territory with our walkers, or have a fun-filled bouncey time with our jumpers. Got a little Einstein out there? Our exclusive selection of pre-school learning toys is just made for them.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 2688, "catid": 22, "level": 1, "url": "http://www.target.com/c/kids/-/N-5xtyp", "text": "kids", "department_url": "http://www.target.com/c/kids/-/N-5xtyp", "description_wc": 0, "description_text": "Give your child the best in everything, from clothes to bedroom fashions. Target has all you need to keep your toddler, preschooler, school-goer, tween or teen happy. Update your child\u2019s wardrobe with the latest styles from our collections. Little Ms. Pretty or Mr. Handsome, we have stylish kids\u2019 clothing, shoes and more for both boys and girls. And when it comes to decorating a bedroom on a budget, you can\u2019t go wrong with Target. We have kids\u2019 bedroom sets , comforters, pillows and quilts to make the room exactly what was envisioned. For adorable little girls\u2019 rooms, we have Hello Kitty , Disney Princess and Barbie bedding sets in delightful pinks, purples and other charming colors, so she can join her 2D BFFs to board the sweet dreams express. Angry Birds, TMNT, Thomas the Train and Avengers bedding sets are the perfect upgrade for your little guy\u2019s bedroom. Have a teen at home? Transform his or her bedroom quicker than a mood, with our teen bedding collections. From florals and stripes to solids and plaids, our bedding pieces are available in a myriad of colors and patterns made to match any d\u00e9cor. Our kids\u2019 room furniture pieces include beanbags, gaming chairs, bookcases, desks, ottomans, step stools and more. You\u2019ll find everything you need to transform your child\u2019s room into a favorite escape. Fun and learning go hand in hand with our collection of kids\u2019 books , games and crafts. With so many fun items in one place, your child may never want to leave his or her room!", "department_text": "kids", "department_id": 4},
{"nr_products": 186, "catid": 23, "level": 0, "url": "http://www.target.com/c/kids-boys-accessories/-/N-5xty9", "text": "boys' accessories", "department_url": "http://www.target.com/c/kids/-/N-5xtyp", "description_wc": 0, "parent_url": "http://www.target.com/c/kids/-/N-5xtyp", "parent_text": "kids", "parent_catid": 22, "department_text": "kids", "department_id": 4},
{"nr_products": 542, "catid": 24, "level": 0, "url": "http://www.target.com/c/kids-boys-clothing/-/N-5xty4", "text": "boys' clothing", "department_url": "http://www.target.com/c/kids/-/N-5xtyp", "parent_url": "http://www.target.com/c/kids/-/N-5xtyp", "description_wc": 0, "description_text": "We know how it goes when it comes to shopping for boys. So we\u2019re prepared with every kind of outfit to match your boy\u2019s sense of style. Whether you want matching separates, outerwear or school uniforms, we\u2019ve got what he needs. Tees , shirts, hoodies , pants and shorts in a variety of styles and colors are available. Is your child the outdoorsy type? Check out our selection of boys\u2019 activewear for athletic tees, running shorts, denim jeans and more. Who said formal wear is for dads only? Our selection of dress pants and formal shirts will make your boy look seriously stylish. We\u2019ve also got an impressive selection of sleepwear, robes and pajamas designed for your growing, young man. From warm footed sleepers to character-based pajamas, Target has tons of fun and comfortable sleepwear. When it comes to brands, there\u2019s a lot to choose from. We have outfits from C9 by Champion , Circo , Cherokee, dENiZEN by Levi's and lots more. Whether he likes to dress up or down, Target\u2019s got the style, brand and selection to handle his tastes.", "parent_text": "kids", "parent_catid": 22, "department_text": "kids", "department_id": 4},
