{"nr_products": 818, "catid": 26, "level": 0, "url": "http://www.target.com/c/kids-girls-accessories/-/N-5xtwl", "text": "girls' accessories", "department_url": "http://www.target.com/c/kids/-/N-5xtyp", "description_wc": 0, "parent_url": "http://www.target.com/c/kids/-/N-5xtyp", "parent_text": "kids", "parent_catid": 22, "department_text": "kids", "department_id": 4},
{"nr_products": 826, "catid": 27, "level": 0, "url": "http://www.target.com/c/kids-girls-clothing/-/N-5xtwa", "text": "girls' clothing", "department_url": "http://www.target.com/c/kids/-/N-5xtyp", "parent_url": "http://www.target.com/c/kids/-/N-5xtyp", "description_wc": 0, "description_text": "Every little girl deserves to be treated like a princess. Target helps her look the part by catering to the young fashionista in your family with the latest styles and designs. Our girls\u2019 clothing collection is pretty, sophisticated and fun. Experiment with lengths, cuts and colors to suit every occasion. From skirts, bottoms and tops to dresses and outfits, the assortment is extensive and the colors are exciting. At Target, we believe that a girl\u2019s clothes should complement her personality. Our featured brands include market leaders like D-Signed, Harajuku Mini and C9 by Champion , offering everything from cute Disney character-inspired looks to hip street-style wear. Along with her outfits, we also have outerwear, sweaters and nightwear to keep her covered from head to toe, day or night, indoors or out. Keep her toasty warm in our faux-fur jackets, hooded vests, ponchos and pea coats. Socks and tights in coordinating or contrasting hues will complete her outfit. Your little dancer will love to pirouette, tap or swing in our leotards , leg warmers and tutus. Nighttime is fun time with Hello Kitty, Minnie Mouse and Disney Princess pajamas and nightgowns. Our girls\u2019 underwear collection provides an assortment of bras, boyshorts, briefs, hipsters and more, to give her the confidence she needs and the perfect fit. From babyhood to adulthood, Target is just what every girl needs to look and feel her best.", "parent_text": "kids", "parent_catid": 22, "department_text": "kids", "department_id": 4},
