{"nr_products": 20746, "catid": 57, "level": 1, "url": "http://www.target.com/c/home/-/N-5xtvd", "text": "home", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Home is where you get to relax and be yourself. So, get ready to put your own personal stamp on your space. From home d\u00e9cor pieces and furniture sets to kitchen appliances and bedding sets, Target has everything you need to make your home a place you don\u2019t just live in, but love! Whether you want to update your home or decorate your first apartment, our extensive range of home decorating products will help your home d\u00e9cor ideas take flight. Just choose from our collection of furniture pieces, lighting fixtures and accessories and once you\u2019ve set that last item in place, you\u2019ll never feel like leaving home again. If you need a little help completing your household chores more efficiently, our home appliances, like vacuum cleaners , dishwashers, washers and dryers will turn you into a time management expert. Set the right temperature and get fresh air with our heaters, air conditioners, humidifiers and air purifiers. Preparing daily meals can be a huge undertaking after a long day. Our assortment of kitchen appliances from top-notch brands, like KitchenAid , Panasonic, GE, Black & Decker and more will make cooking quicker and easier than ever before. Whether you prefer Italian, French or Mexican dishes, Target offers you ovens and microwaves, blenders, mixers and more to make your family\u2019s favorites in no time. Don\u2019t let those tasty meals translate into a few added pounds- our scales can help you stay on track. From food scales to measure portion sizes and bathroom scales to measure your weight, we have them all. Shopping at Target just means one thing! You\u2019ll never go wrong!", "department_text": "home", "department_id": 7},
{"nr_products": 1324, "catid": 58, "level": 0, "url": "http://www.target.com/c/home-bath/-/N-5xtvc", "text": "bath", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Bathroom accessories are just what you need to make the right statement in your bath. Whether it's a full, half, master, kids' or guest bath, your accessories from Target will help create the perfect look. There's so much to choose from that you may find yourself wishing for additional baths to decorate. Just sayin'! Luxuriously soft bath rugs and toilet covers in amazing palettes of color await! You will be hard-pressed when it comes to selecting coordinating towels. Will you choose the pretty prints, dramatic dots, or crazy character prints? Or will you go for the microfiber solids or colorful stripes? Shower curtains will tie the whole look together. With dozens of choices in floral, geometric patterns and more, your curtains will jazz up your bathroom. Ready to revamp your bath? Bathroom mirrors in a variety of sizes, shapes, styles and finishes will help create light and ambiance. You can never have too much storage, right, ladies? Bathroom furniture consisting of wall cabinets, floor cabinets and medicine chests will provide the room you need to keep your supplies organized and out of sight. Did we cover everything? Not even close! There is so much more. You name it, we have it! So, out with the old and in with the new from Target!", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 1441, "catid": 59, "level": 0, "url": "http://www.target.com/c/home-bedding/-/N-5xtv4", "text": "bedding", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Planning to revamp your little one's room? Shop at Target for an exclusive collection of decorative kids' bedding and give his bedroom the perfect room makeover. How about a complete bedding set in a theme your kiddo will love? From polka dots and stripes to peace signs and pirates, we have coordinating collections of sheets, pillowcases and blankets to crank the \"cool\" factor up a notch. Most kids have their own favorite cartoon or movie characters. How about a bedroom d\u00e9cor that lives up to their fascination? Your little Jedi will think our Star Wars themed bedding is out of this world. And your sweet little explorer will love to snuggle up with Dora every night! You can also mix and match our duvets and quilts with our wide assortment of bedskirts, sheets and pillowcases to create your own look. How about a ballerina theme for the little dancer? Or maybe sports theme for the future quarterback in your family? Top off the look with our decorative pillows to add the perfect finishing touch. Kids can fall asleep just about anywhere. (Not when you tell them to of course, that would be too easy!) But for the unexpected snoozer in the family, choose one of our kids' nap mats for napping on the go. And how about our blankets and throws for an impromptu cuddle fest? Plush and soft \u2013 they're irresistible! Whether you have a toddler or a teen or anything in between, Target has awesome bedding choices that are cool, stylish and rocking!", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 944, "catid": 60, "level": 0, "url": "http://www.target.com/c/home-home-appliances/-/N-5xtuu", "text": "home appliances", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Target redefines smart living with our home appliances. We help you customize your indoor environment with our high-performance heaters and humidifiers, so you'll stay warm and comfortable during the chilly months. When summer is at its peak and cool air is a must-have, our air conditioners, dehumidifiers and fans can turn stuffy indoors into a comfy place to relax. Our weather instruments give you the indoor and outdoor temperature, humidity, amount of rainfall and more, all at just a quick glance. If eliminating odors and improving your indoor air quality is a priority, check out our air purifiers from top-selling brands like Honeywell and Germ Guardian. We know a clean home is a healthy home, and that's why we\u2019ve got everything from steam mops to sweepers to help you keep your home spotless. Whether it's a soiled rug or a spill on your hardwood floor, our vacuums and floor care products will get the job done. Target also has fabric steamers, irons and ironing boards, sewing machines and many more handy appliances. Shop Black & Decker , Conair, Whitmor, Panasonic and other top brands to help keep your clothes looking new. Do you need a convenient laundry station for your second floor, garage or mudroom? Choose from reliable and compact washing machines and dryers from brands like Haier. Get these must-have appliances from Target and keep your home comfortable and healthy.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 6764, "catid": 61, "level": 0, "url": "http://www.target.com/c/home-home-d\u00e9cor/-/N-5xtub", "text": "home d\u00e9cor", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Looking to update your home d\u00e9cor? You can decorate your home from attic to basement with the selections from Target! Our lamps and lighting will help you create any mood you desire in any room in your home. If you need a little task lighting in your kitchen and dining room, or perhaps a little mood lighting in your bedroom, we've got it under control! Create a little ambiance with deliciously intoxicating candles and scents. Pick up fun, funky decorative accents for a fresh look. Target has an extensive selection to appeal to a variety of tastes. Mirrors are a creative way to give an illusion of more space. Target has mirrors in a variety of shapes, with frames or without, to suit any d\u00e9cor. Photo frames, sconces and wall d\u00e9cor items are the perfect way to make your house a home. Want to create a new look in your dining or living room? Try our slipcovers! Cover worn chairs with stretchy or draped fabrics for a dramatic transformation. If you're on a budget, this is an ideal way to jazz up your home for less! Add a few strategically placed rugs throughout the home and a few pillows and throws onto the couches or chairs to breathe new life into existing color schemes. You can complete the look with new curtains and blinds. Target is just what you need when you're designing or redecorating your home. The home d\u00e9cor pieces also make perfect housewarming gifts.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 1655, "catid": 62, "level": 0, "url": "http://www.target.com/c/home-home-improvement/-/N-5xtt9", "text": "home improvement", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "If you're looking to completely overhaul your home, or just make a few minor changes, Target has what you need to get the job done your way. From power tools to cleaning products, Target is the answer to all of your home improvement needs. Whether your cabinets need a facelift by adding stylish knobs and pulls, or you want to install motion detector lights or an alarm system, we've got everything you need. Create a comfortable home environment with our space heaters , air purifiers, humidifiers , air conditioners and fans. To clean up spills and keep things tidy, we offer a variety of cleaning products from wet/dry vacuums and brooms, to mops and all-purpose cleaners. Change things up a bit with wallpaper, contact paper and repositionable wall d\u00e9cor. A toolbox is a do-it-yourselfer's best friend. Target has hand tools ranging from screwdrivers to wrenches to keep your toolbox well stocked and ready for any type of repair. From interior and exterior paint, duct tape, masking and painter's tape to tape measures and levels \u2013 we have them all. You'll also find flashlights, headlamps and work lights for working in low-light areas. If you're working on ceilings, gutters or roofs, our step stools and ladders will give you a boost to get the job done. Complete your home improvement projects with supplies from Target today.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 4065, "catid": 63, "level": 0, "url": "http://www.target.com/c/home-kitchen-dining/-/N-5xtsc", "text": "kitchen & dining", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "So we got a new cookbook and want to try out some of the recipes. Are you free Saturday night? Great\u2014dinner party at Target! Any food restrictions? Oh, you don't do meat, shellfish, carbs, dairy, gluten, nuts or sugar? And you're in an \"orange food only\" phase? No problem, we've always thought the other 99.9% of food is overrated anyway. And just bring yourself because we've got everything else covered. Here you'll find all the cool kitchen appliances, kitchen tools, kitchen gadgets, and kitchen cutlery and knives you could ever want for fast and easy food prep. Speaking of things with blades, here's something to sharpen your kitchen trivia skills: Stamped knives cost less than those with handcrafted forged blades, but the forged ones are stronger, more comfortable, and safer to use. However you cut it, though, we've got a huge selection of all kinds. And we carry a crazy-big assortment of cookware and bakeware, too, including great collections from your favorite foodies like Giada, Paula and Rachael. Now let's talk organizational skills. To help you make the most of your kitchen space, we offer tons of smart solutions for kitchen storage and organization, along with cute aprons and kitchen towels in a rainbow of colors. And we'll help set the table with a delectable selection of stylish table linens, dinnerware, glassware and drinkware, flatware and silverware sets\u2014ranging from four to twelve settings\u2014with something for every taste and budget. Dig in.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 4336, "catid": 64, "level": 0, "url": "http://www.target.com/c/home-patio-garden/-/N-5xtq9", "text": "patio & garden", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Cooking, storage and relaxation are not just part of indoor living, the world is changing and it\u2019s great to bring the fun outdoors. Target has an extensive range of outdoor furniture and patio accessories including heaters, fire pits and coolers to get your patio ready to roll, no matter what the season. If entertaining guests is something you do often, you\u2019ll love our outdoor grills , BBQ tool sets and carts. After all, it\u2019s good to call up friends every now and then for a grill party and board games - an easy way to melt away stress. Not just that, we also have super cozy patio furniture to set the stage for the big night. Cushions, pillows, umbrellas, canopies and a whole lot of patio accessories for setting up the perfect outdoor party. So why wait, just let the party animal in you go wild, all in the comfort of your backyard! Whether you want to mix and match for a personalized touch or give your patio a coordinated look \u2013 just take your pick from individual furniture pieces or opt for a patio furniture set. Either way, Target has it all. Is gardening more than just a hobby for you? Target also brings you all sorts of gardening tools, hoses and sprinklers for the DIY types like you to beautify your outdoor space.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 1456, "catid": 65, "level": 0, "url": "http://www.target.com/c/home-storage-organization/-/N-5xto8", "text": "storage & organization", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Tired of spending your free time looking for the thing you want to spend your free time using? Well, it's Target to the rescue! Stuff your stuff into our stuff and get organized with our vast array of home storage and organization solutions. Target's organizers can help you get it all together and keep it there! We've got media storage the whole family can love, from classy Case Logic to funky Discgear. Easily access your movies, music, photos and games with our CD/DVD cases, boxes, towers, wallets and sleeves. Need a place for accessories? Check out our storage furniture. How about a bench or ottoman that doubles as a trunk? We've got brightly colored storage units for kids' rooms, flexible fabric for closets and under the bed, baskets for your bangles and shelving for your shoes. If you've got it, Target has a place for it! Whatever your decor, we've got affordable storage & wall cabinets to match. Find them with wood finishes, metal shelves or glass fronts; they come with cubes, shelves, drawers, doors and baskets. Large or small, you're sure to find the perfect fit for every room. We even have smartly designed garage storage units to help you put your tools and supplies in order while making space for more stuff! And don't forget the laundry. Conquer your mountain of mess with our clever laundry solutions. And while you still have to empty the garbage, Target's selection of trash cans & bins makes it SO much nicer!", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 4459, "catid": 66, "level": 1, "url": "http://www.target.com/c/furniture/-/N-5xtnr", "text": "furniture", "department_url": "http://www.target.com/c/furniture/-/N-5xtnr", "description_wc": 0, "description_text": "Moving into a new home feels great, but furnishing your home makes it uniquely yours! Whether you're setting up your new home from scratch or upgrading the decor, Target has just what you need. Shop our home furniture collections to find the perfect pieces for any room. From the foyer to the bedroom and everything in between, decorate your entire home with furniture to suit your tastes and your lifestyle. Simple or bold, classic or contemporary, whatever your style, we've got you covered. Is storage a concern? We have a smart assortment of home furniture that gives your home a stylish touch with convenient storage options. These space-saving pieces include armoires , open shelving, closed cabinets, bookcases , storage benches, and media stands. If color is your passion, try some of our full-color favorites in reds, yellows, greens and more. You\u2019ll find bright accent chairs, counter stools, side tables, dining chairs and an endless list of accessories in a variety of hues. Add the right type of home furniture to make the most of your space. From futons , swoop chairs and coffee tables for the living room, den or family room to dining sets, kitchen tables and benches, Target has every style of home furniture to suit your needs.\u00a0 Don't forget our furniture collections for home office, kids\u2019 rooms, bathrooms and bedrooms. From towels to linens, accessories and office equipment, you'll find what you need to make your house a home in one convenient place. Begin your furniture search at Target and you'll spend less time hunting and have more time to enjoy your fabulous furniture finds.", "department_text": "furniture", "department_id": 8},
{"nr_products": 126, "catid": 67, "level": 0, "url": "http://www.target.com/c/furniture-bathroom-furniture/-/N-5xtnq", "text": "bathroom furniture", "department_url": "http://www.target.com/c/furniture/-/N-5xtnr", "description_wc": 0, "parent_url": "http://www.target.com/c/furniture/-/N-5xtnr", "parent_text": "furniture", "parent_catid": 66, "department_text": "furniture", "department_id": 8},
{"nr_products": 575, "catid": 68, "level": 0, "url": "http://www.target.com/c/furniture-bedroom-furniture/-/N-5xtnl", "text": "bedroom furniture", "department_url": "http://www.target.com/c/furniture/-/N-5xtnr", "parent_url": "http://www.target.com/c/furniture/-/N-5xtnr", "description_wc": 0, "description_text": "Home is where your bed is! Sure you sleep there, but your bedroom is also a sanctuary for relaxation. Make your slumber zone reflect your personal style with the diverse selection of bedroom furniture at Target. Whether it's cozy or spacious, bright or subdued, Target stocks mattresses, beds and headboards to complete your special space. When you reach out in the middle of the night for a drink of water, your cell phone or your glasses, your nightstand is like your personal valet, you count on it to be there! Well, they're sturdy, they're stylish and they're here at Target! Looking for smarter storage options? You just got lucky! Expand your space with something from Target's selection of armoires, wardrobes, dressers and chests. Toys scattered everywhere in your kid's bedroom? De-clutter in an instant with smartly designed bedroom storage units. Or jazz up the space with colorful benches to make room for the kid next door and some of his little friends. Or, if you want one for your bedroom, then go on. It's all there! If you shop with us, you can be sure of two things - finding the right piece of furniture (yes! we have loads of smart collections), and finding everything in one place. Whether you're decorating your bedroom or building it right from scratch, we're here to guide you in the right way! Now we don't think there's any point in talking further - just get clicking and you're in for some smart shopping!", "parent_text": "furniture", "parent_catid": 66, "department_text": "furniture", "department_id": 8},
{"nr_products": 180, "catid": 69, "level": 0, "url": "http://www.target.com/c/furniture-entryway-furniture/-/N-5xtn5", "text": "entryway furniture", "department_url": "http://www.target.com/c/furniture/-/N-5xtnr", "description_wc": 0, "parent_url": "http://www.target.com/c/furniture/-/N-5xtnr", "parent_text": "furniture", "parent_catid": 66, "department_text": "furniture", "department_id": 8},
{"nr_products": 313, "catid": 70, "level": 0, "url": "http://www.target.com/c/furniture-home-office-furniture/-/N-5xtn0", "text": "home office furniture", "department_url": "http://www.target.com/c/furniture/-/N-5xtnr", "parent_url": "http://www.target.com/c/furniture/-/N-5xtnr", "description_wc": 0, "description_text": "Is working from home giving you the \"Monday Blues\" every day of the week? Well, maybe it's just time for a home office makeover! If pulling up the same old chair to the same old desk is getting you down, don't worry. We have home office furniture collections that will put you on the fast track! Staying organized can be a challenge when you've got too much on your plate. Whether your style is classic or contemporary, our bookcases, desk hutches and filing cabinets are up to the task and great for your bottom line. And speaking of elegant wood-finished office workstations... we weren't, but we are now! At Target, you'll find a selection that is sure to impress the boss. Oh, wait \u2014 that's you! Sometimes all you need is a splash of color. Check out the funky designs in the TOO by Blu Dot collection of tables and chairs. Fun! Don't underestimate the power of a good chair! Did you know the word \"ergonomic\" comes from the Greek words \"ergon\" (\"work\") and \"nomos\" (\"laws\")? And on that note, we declare many of our office chairs are ergonomically designed for use in any home office! Of course, there's more to a home office than desks, printer stands and conference tables. They often say, \"It's the little things...\" And boy, are they right! So don't forget the desk lamps, the rugs, the wall d\u00e9cor and the chair mats. Think outside the box and pencil it in!", "parent_text": "furniture", "parent_catid": 66, "department_text": "furniture", "department_id": 8},
