{"nr_products": 4927, "catid": 103, "level": 1, "url": "http://www.target.com/c/electronics/-/N-5xtg6", "text": "electronics", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Tech savvy or not, electronics are a necessity. It\u2019s difficult to imagine a world without electronics. Be it for comfortable living, education, entertainment, communication or home improvement, we rely on electronics. Target brings the world of electronics to your doorstep. You can find everything from home theater systems, cell phones and audio players to air conditioners and HDTVs right here. Whether you are in the mood for information, infotainment or sheer entertainment, the world of connected electronics has it all. Be it for your home, or office, our stylish and slim LCD computer monitors are the perfect choice. While you are away or on-the-go, stay connected with your family and friends anywhere anytime with our laptops, tablets and smartphones. Do you like hiking, camping or trekking? Planning a road trip? Target offers you latest in-car units and handheld GPS systems to help you stay right the track. Don\u2019t forget to pick up one of our point-and-shoot cameras, DSLR cameras or digital camcorders. So, when you leave your adventure behind, you\u2019ll take the memories along with you. Love to stay indoors? It doesn\u2019t mean that you have to miss out on all the fun. Take your pick from one of the latest gaming consoles, you\u2019ll know what real entertainment is. Whether you are a hardcore gamer or a casual one, we have the latest collection of Xbox One, PlayStation 4 and PlayStation 3 games to help you get your game on. Prefer reading? Our eReaders will let you access to the largest collection of books online.", "department_text": "electronics", "department_id": 14},
{"nr_products": 653, "catid": 104, "level": 0, "url": "http://www.target.com/c/electronics-cameras-camcorders/-/N-5xtez", "text": "cameras & camcorders", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Strike a pose! Do you love to capture every moment on camera? Then you've landed on the right page. At Target, you\u2019ll find every kind of camera from point-and-shoot to high-tech DSLR cameras. Digital cameras are super easy to use and are perfect for parties, holiday gatherings and traveling. Point-and-shoot cameras are compact and user-friendly enough that you can count on getting the shot. Go for a durable camera if you're an adventure seeker. Many models can withstand a dunk in the water or a drop on the ground. When convenience is a priority, Wi-Fi cameras upload images directly to your laptop or smartphone. Instantly share pics with your family and friends, and lose the messy wires and extra adapters. We haven't forgotten about you serious, professional photographers out there. Target has a variety of sophisticated digital SLR cameras for you, too. Check out our selection of high-end DSLRs from Nikon , Canon and Sony . We also have optical zoom cameras and interchangeable camera lenses . A picture says a thousand words, but a video captures every detail. Take amazing videos with crystal-clear audio with our camcorders. From DVRs to palm-sized handheld camcorders, you'll find the features you need to suit your lifestyle perfectly. Check out our extensive assortment that also includes photo printers, binoculars, security cameras, camera cases and other accessories.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 1294, "catid": 105, "level": 0, "url": "http://www.target.com/c/electronics-cell-phones/-/N-5xte8", "text": "cell phones", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "A cell phone is your best friend, it\u2019s your identity, it\u2019s YOU! Gone are the days when these mobile devices were just to make calls or send text messages. Today\u2019s hi-tech smartphones are magical. From surfing the web and checking mail to streaming videos and locating a street on the other side of the globe, you can do anything and everything with a smartphone. Get yours today at Target! Whatever be your favorite brand, we have them all. Find brands like Nokia, Blackberry, HTC, Virgin, Samsung, LG, Motorola and more here. Looking for cell phones with plans from AT&T, Sprint, T-Mobile and Verizon Wireless or unlocked phones from top-selling brands? We have you covered. For those who love to explore thousands of exciting apps, Android phones like Samsung Galaxy are a great choice. Prefer style and sophistication? The Apple iPhone is just made for you. Here at Target, we just don\u2019t stop with cell phones; you\u2019ll also find a whole new range of accessories like Bluetooth headsets, chargers, adapters, screen protectors and more. Be it for an extra layer of protection or adding a touch of fashion, you\u2019ll find attractive and stylish cases for your iPhone, Windows or Android smartphone. We know it\u2019s fun to own the latest smartphone in the market, and Target adds to the excitement with super-cool online deals and discounts. So, why wait? Pick your favorite cell phone along with the right accessories and get ready to explore the endless possibilities of the mobile world.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 1289, "catid": 106, "level": 0, "url": "http://www.target.com/c/electronics-computers/-/N-5xtfc", "text": "computers & tablets", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Computers are a must-have. Target offers a whole range of laptops and tablets for personal and professional use. Take your pick from some of the top brands in computers like Apple , Acer and Samsung and always be connected. Tablets are perfect for lovers of multimedia. With anywhere from 16 to 128GB, the Apple iPad is one of our bestsellers. We also offer several top-rated tablets that are perfect for gaming, shopping, reading and watching movies anywhere, anytime. Kids' tablets are also in high demand. LeapFrog , VTech and Camelio have launched tablets for kids to keep them occupied with their favorite learning and educational games or videos. This gives them their own equipment, and most options come pre-loaded with excellent parental controls. A laptop is an essential gadget that you can't go without. Before buying, it's smart to know yours needs and compare specs. At Target, we cater to diverse system requirements with our large collection of laptops, integrating a variety of features. If you love to read, our NOOK eReaders are the way to go. But if video games are your calling, our desktops and computers will blow your mind with their amazing graphics and special effects capabilities.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 67, "catid": 107, "level": 0, "url": "http://www.target.com/c/electronics-GPS-navigation/-/N-5xtd8", "text": "GPS & navigation", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 176, "catid": 108, "level": 0, "url": "http://www.target.com/c/electronics-home-phones/-/N-5xtdc", "text": "home phones", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 1049, "catid": 109, "level": 0, "url": "http://www.target.com/c/electronics-iPods-audio/-/N-5xte2", "text": "iPods & audio", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Get the best selection of Apple iPods, headphones and other audio devices all in one place. We have the top-rated audio electronics, so you can always listen to your favorite music, wherever you are. The boombox has made a comeback. Today's streamlined & portable models express your individuality. And when you want to listen privately, headphones and earphones are perfect choices. Take your pick from classic over-the-head or over-the ear headphones from top brands like Beats By Dre , or ones with snug-fitting, noise-canceling rubberized earbuds . iPod and MP3 players are always in style. Popular brands like Apple and Sansa offer players that are user-friendly, compact and lightweight. Of course, we can't talk about audio equipment without mentioning Bose and Jawbone portable speaker systems. Whether you want to share your music or keep it private, you'll find the right set-up at Target. For enjoying music on-the-go, portable, rechargeable, Bluetooth and wireless speakers from brands like iHome and SONOS are making a place for themselves in the market. You can even infuse some vintage-style entertainment in your home with a turntable. There's nothing like vinyl to get you feeling a little retro! Our alarm clocks with speaker docks do double-duty. Their multi-purpose designs free up premium dresser, desktop or nightstand space. Don\u2019t forget to check out our audio accessories like connector cables, USB chargers, iPod cases and screen protectors. Target has the audio devices you need to stay wired for sound.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 294, "catid": 110, "level": 0, "url": "http://www.target.com/c/electronics-TVs-home-theater/-/N-5xtdw", "text": "TV's & home theater", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 1860, "catid": 111, "level": 0, "url": "http://www.target.com/c/electronics-video-games/-/N-5xtg5", "text": "video games", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Want to play a video game? Yay! You pick which one. Oh\u2026you want Pong? Well, that was really cool back in 1972, but the gaming industry's actually made some advances in the last 40 years. Seriously, you should see all the great video games that Target carries these days. You'll find Xbox games , PS3 games and Nintendo Wii games in a genre for every mood: there's action, adventure, dance, family, fighting, music, racing and sports\u2014along with the hottest new releases and pre-order titles. And there are even portable consoles now like PSP (short for PlayStation Portable), so gamers can take their fun anywhere. And the traditional consoles have advanced so much that they can work with sensors now to see your motion, so you don't even need controllers anymore. (Controllers are updated joysticks, just in case you were wondering). If you're on an Xbox 360 and you get the Kinect Sensor, you can play up to 6 feet away. Or working with the PlayStation 3 console (also known as PS3 ), the PlayStation Eye Camera sees you from 3\u201310 feet away\u2014those games are called PlayStation Move. Or maybe you want to get a move on with that PlayStation 4 (also known as PS4 ) or Xbox One everyone's been talking about. On the Nintendo Wii U the sensor is built in, so you don't need a separate accessory for that one. And here's something else about those consoles: They all stream video and even Netflix. But yes, Pong was very cool.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 619330, "catid": 112, "level": 1, "url": "http://www.target.com/c/entertainment/-/N-5xsxe", "text": "entertainment", "department_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "description_wc": 0, "description_text": "Say \u201cGoodbye!\u201d to boredom once and for all! Target opens up a new dimension of home entertainment with an extensive collection of music, movies and books. Classical, country, pop, rap or rock \u2013 we\u2019ve got music for every mood! Do you have a favorite singer? Pick any one of the bestselling albums off our shelves. Don\u2019t just stop there! Share your love for music with our exclusive iTunes and music gift cards . A movie buff? We bring Hollywood entertainment right to your door. From westerns to action and classics to chick flicks, enjoy your favorite movies all in the comfort of your home. Get one of the best-in-class HDTVs, Blu-ray players and speakers from Target to set up your home theater system. Now you won\u2019t have to go a theater every time you feel like watching a movie. If you think you\u2019ll miss that bucket of popcorn\u2026you won\u2019t. Target has popcorn makers, too. For those who prefer reading books to the exclusion of everything else, except maybe breathing, you\u2019re at the right place. Whether you like romance, mystery, sci-fi, action or fantasy, we have the top-selling novels from new and popular authors. If inspiration, motivation and insight are just what you need, check out our large collection of non-fiction books. Entertainment can\u2019t get any better than when it\u2019s animated and interactive, right? Whether you want to keep your brain ticking or get your adrenaline pumping, Target offers you an exciting selection of action, adventure and strategy games for Xbox One, PlayStation 3 and Nintendo 3DS consoles. If you prefer to challenge your mind or defeat your enemies on your laptop or desktop, our latest PC games will help you succeed.", "department_text": "entertainment", "department_id": 15},
{"nr_products": 364487, "catid": 113, "level": 0, "url": "http://www.target.com/c/entertainment-books/-/N-5xsxd", "text": "books", "department_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "parent_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "description_wc": 0, "description_text": "You\u2019ll find the books you want, all in one place and at prices you'll love. What more could a bookworm want? Target has all of the major genres, from fiction and comics, pet and psychology to computer and technology . We have a wide variety of books from emerging authors and long-anticipated reads from fan favorites. Discover your next book club pick by browsing through our NY Times Best Sellers list. We make it easy to quickly grab a copy of your favorite author's books. If you're looking for something totally new, take a sneak peek at the upcoming releases of the latest novels or thrillers . Have a little Laura Ingalls Wilder or Marvel fan at home? Encourage your child's reading habit with comic, chapter, series and teen books . Smaller kiddos will love perfectly sized board book collections. Looking for some self-help books? Our selection of parenting and family, self improvement, health and fitness will get you on the right track. Test prep and study guides come in handy for upcoming exams. From cookbooks to autobiographies, Target has tons of books when you're looking for a good read or a little helpful advice.", "parent_text": "entertainment", "parent_catid": 112, "department_text": "entertainment", "department_id": 15},
{"nr_products": 72406, "catid": 114, "level": 0, "url": "http://www.target.com/c/entertainment-movies/-/N-5xsx0", "text": "movies", "department_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "parent_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "description_wc": 0, "description_text": "If getting cozy on your couch with a bucket of popcorn sounds like a great way to spend an evening, then you need an extensive selection of movies ready for you at your fingertips. Step into the world of Target and make your picks from a huge collection of 3D Blu-rays, Blu-rays and DVDs covering every movie genre, from drama, comedy, action and adventure to horror, romance, sci-fi and fantasy. Love superhero movies? Check out our collection of DVDs and Blu-ray movies that spans decades of action-packed performances. Animation isn\u2019t just for kids. Pick your favorite movie from the vast array of titles, like The Little Mermaid, Peter Pan, Despicable Me 2, Epic and more from our kids' hits Blu-ray and DVD collection. Don\u2019t forget about classic-cult hits, nail-biting drama, sidesplitting comedy and tear-jerking romances. You name it, we have it. Target has Blu-ray movies and DVDs for every age, no matter the genre. You can even make selections based on your budget with the \"movies under $10\" and \"movies under $15\" categories. Also be sure to check out Target Ticket to enjoy the latest digital movies and TV shows. Want more? You can now set up your home theater system with our wide range of HDTVs, speakers and Blu-ray players to enjoy your favorite flicks, all in the comfort of your own home.", "parent_text": "entertainment", "parent_catid": 112, "department_text": "entertainment", "department_id": 15},
{"nr_products": 182317, "catid": 115, "level": 0, "url": "http://www.target.com/c/entertainment-music/-/N-5xswr", "text": "music", "department_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "parent_url": "http://www.target.com/c/entertainment/-/N-5xsxe", "description_wc": 0, "description_text": "Music is the soul of life. At Target, we offer the latest and greatest CDs and vinyl records from all genres to cater to a variety of preferences. Our selection is like a party featuring the world's favorite music and you're all invited. Every Blues fan will be thrilled with our collection of famous albums, like Didn't It Rain by Hugh Laurie, Time After Time by Etta James or Living Proof by Buddy Guy. If classical is more your style, the Ultimate Puccini Collection or The Phantom of the Opera will delight you. From Taylor Swift to George Strait, our country music collection offers a wide variety of CDs by world-renowned artists. Rap and rock music from performers like Jay-Z, Eminem, Fergie, Pearl Jam, Jackson Browne and more will help you get your groove on. You'll seriously get your party started with our electronic and dance collection. Our pop-music albums feature some of the bestselling artists like Justin Timberlake, Katy Perry, Selena Gomez and more. We also have Target Exclusives like albums from Celine Dion, Elton John and Cher. Target also caters to the youngest music aficionados. Disney Babies, Toddler Favorites, The Best of Elmo, Lion King: Karaoke Series and others will introduce your children to the wonderful world of music and all it has to offer. To take your new music on the go, check out our iPod and MP3 players , headphones and more.", "parent_text": "entertainment", "parent_catid": 112, "department_text": "entertainment", "department_id": 15},
{"nr_products": 8891, "catid": 116, "level": 1, "url": "http://www.target.com/c/toys/-/N-5xtb0", "text": "toys", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "No matter how full the toy box is, your little ones will still want more toys. At Target, you\u2019ll find a huge assortment of action and learning toys for children of all ages. But it\u2019s not all about fun and games. Our toys feed minds with creativity and imagination, making them enjoyable and entertaining! Get your little girl a classic like Barbie, or a new addition like a Lalaloopsy or Monster High doll. She\u2019ll be busy dressing up her new best friend, setting up her dollhouses and hosting tea parties. For adventurous little girls, we have Hello Kitty scooters, remote-controlled cars, bikes and more. Have a busy little guy at home? Then, he\u2019s got some serious playtime ahead of him with our collection of train sets, tractors, airplanes and a whole lot of radio-controlled vehicles. Add variety to his toy collection with our building sets, puzzles, action figures, toy blasters and more. If he loves Disney Planes or Pixar Cars, check out our collection of Disney games ! You\u2019ll also find electronic toys for your little techie, riding toys for the adventure seeker, stuffed animals for the little one who loves to snuggle, arts and crafts toys for the creative one and more. From Hot Wheels and LEGO to My Little Pony and LeapFrog, Target has the perfect toys for every kid. Shop for these brands and more of the top-sellers today!", "department_text": "toys", "department_id": 16},
{"nr_products": 729, "catid": 117, "level": 0, "url": "http://www.target.com/c/toys-action-figures/-/N-5xt88", "text": "action figures", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "The thing about action figures is, the more there are to choose from, the more fun there is to be had. And Target offers a ginormous assortment of fun. First of all, there's one of the biggest superheroes ever: Spider-Man. What a tangled web our selection weaves, with everything from Spidey himself to his archenemies. Meaning, of course, that your little ones can stage the best battles in the whole wide webbed world. And for players who prefer their crusaders caped, we've got the one and only Batman. And not just the beloved B-man himself, but also his favorite ways to fly: Batmobiles and Batpods. Our selection saga continues with the force of stellar Star Wars action figures from all the hit movies. You'll find all the favorites, from R2D2 to Mace Windu, and generations of fun in between. And for those into the more earthly super beings, we carry the earth's mightiest heroes, The Avengers. Speaking of heroes, how about that GI Joe guy? We've got everything from the main man himself to his bikes, boats and cohorts, like Snake Eyes. Fun fact: GI Joe's loved by so many that he was inducted into the National Toy Hall of Fame in 2003. Now that's love. And another thing: Calling all Transformers fans! There's loads to love about our selection of those bad boys, along with all the others. Ready, set, action figures.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 794, "catid": 118, "level": 0, "url": "http://www.target.com/c/toys-arts-crafts/-/N-5xt8k", "text": "arts & crafts", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "They say imagination is the greatest key to success. The arts and crafts products offered at Target are designed to nurture the creative minds of the future. We value inspiration and encourage it with our collection of craft, painting and sewing kits. Most little hands love to get dirty. Why not turn their enthusiasm into something fun and constructive? We have an assortment of clay, dough and pottery kits to ignite their artistic flair. Our drawing boards , brush sets, crayon and marker packs from top brands like Crayola and Fisher-Price are designed for the next little da Vinci in the making. For more experienced little artists, our easels, activity desks and studio stations come in handy. Let kids immerse themselves in arts and crafts activity kits like casting, wax molding, creating fashion portfolios, designing totes, robotics and more. They may also enjoy trying their hand at design with our jewelry-making kits. Scrapbooking their fun moments and memories is a great way to keep the magic alive. Make it a group project for some added fun. During the school year, Target has you covered with an extensive range of arts and crafts supplies for projects, reports and fairs.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 794, "catid": 119, "level": 0, "url": "http://www.target.com/c/toys-building-sets-blocks/-/N-5xt8r", "text": "building sets & blocks", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 1339, "catid": 120, "level": 0, "url": "http://www.target.com/c/toys-dolls/-/N-5xt90", "text": "dolls", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "At Target, we love dolls so very much\u2014it's why we carry so very many. First off, there's one of the most famous dolls of all, Barbie. With all the top Barbie toys ranging from dream homes to dolls, and with dolls ranging from mermaid collector editions to that handsome devil, Ken, there's some fun for every imagination. Here's a little factoid that even the most avid fans might not know: The blond icon's middle name is Millicent. Yeah, pretty fancy. And fancy this: There's so much Monster High stuff here, it's scary. There are droves of dolls (plush ones even) from Cleo de Nile to Laguna Blue, and other goodies from hair chalk to costumes, so your little ones' options for pretend play go on and on. And continuing the pretend play are oodles of Our Generation dolls and accessories, as well as loveable Lalaloopsy rag dolls (formerly known as Bitty Buttons, FYI). Now, about that Disney Brave: Girl power rules! Here you'll find bundles of Brave dolls, jewelry, books, play sets and costumes to get creative with\u2014not to mention our sweet selection of Disney Princess fun from Baby Belle to Toddler Tiana. Lastly, home might be where the heart is, but Target is where the dollhouses are. Seriously, you'll see everything from little Smurf cottages to big princess palaces. Okay, kids, time to get dolled up.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 812, "catid": 121, "level": 0, "url": "http://www.target.com/c/toys-dress-up-pretend-play/-/N-5xt99", "text": "dress up & pretend play", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "Let's pretend your little ones could be anyone in the whole wide world. Anyone. We don\u2019t know who they'd be, but whoever it is, we're pretty sure Target has kids' costumes for it. Our getups run the gamut from pretty princesses\u2026or is it princi?\u2026to rad racecar drivers, superheroes, police officers and doctors. And what goes better with a cute little white coat than a top-notch toy doctor play set? But we realize not everyone wants to be a doctor. For those who prefer a nice set of cooking utensils to surgical instruments, we have a delectable selection of toy kitchens\u2014along with entire playhouses. Fun, fun and more fun. Moving on now to escapes for the outdoorsy types, you'll find all sorts of play tents in all sizes, adorned with all their favorite characters. Lots of toy gardening sets, too, for little green thumbs. The gardening sets are super fun. Plus, what a great way to teach your kids about the importance of fresh produce in their diet. Okay, that concludes our public service announcement for today. But seriously, Target has pretend play fun for techies, too: There's spy gear like night vision goggles and fingerprint kits, and toy cell phones for chatty little Cathys and Charlies to practice their communication skills. So, to sum it all up, Target has a whole lot of pretend play and dress up fun for every kind of imagination. Imagine that.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 562, "catid": 122, "level": 0, "url": "http://www.target.com/c/toys-games-puzzles/-/N-5xt9i", "text": "games & puzzles", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 589, "catid": 123, "level": 0, "url": "http://www.target.com/c/toys-kids-electronics/-/N-5xt9q", "text": "kids' electronics", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "Kids love things that take batteries, it's a proven fact. They love things that beep, things that buzz, things that blink\u2014it's just their way. They all go crazy for electronic toys, and who can blame 'em? We here at Target certainly can't. We go gadget-crazy, too, as you'll see once you get a load of our huge assortment for kids of all ages. Take the mega-loved LeapFrog for instance: We carry their electronic toys for kiddies from baby up through 11 years, so there's something for every growing mind. You'll find LeapFrog software and learning systems, along with the very cool VTech. Speaking of very cool, have you heard of the new AppBlaster? It's an interactive toy gun that works with your iPhone or Android smartphone, and lets kids 8 years and up play some of the coolest apps ever. Shoot, that's fun stuff. Something else that everyone's talking about: Colorful micro-robotic creatures called Hexbugs. In addition to the mechanical insects and other heebie jeebie-inducing critters, you'll find loads of play sets for them to crawl on. And for the squeamish types, the fabulous Fijit Friends Newbies might be a better fit. These little interactive cuties unlock content on their very own website\u2014but that's not all they do. They also sing even perform duets with other Newbies. And to that, we say bravo.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 824, "catid": 124, "level": 0, "url": "http://www.target.com/c/toys-learning-toys/-/N-5xta7", "text": "learning toys", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "The more fun you can feed a growing mind, the better. And there's lots to learn about all the learning toys Target carries to help those hungry little minds develop. For starters, there's the much-loved LeapFrog. At Target, you'll find all the best stuff from them: There's LeapFrog software and loads of learning books, along with superstar systems like Leapster Explorer, My Own Leaptop, Tag Reading, Text & Learn, LeapPad and more. And there's way more to learn, too, with the very cool VTech toys. From them, you'll see systems like VTech Touch, ABC Text & Go, MobiGo Touch, InnoTab Learning App Tablet and V.Reader Interactive E-Reading. But high tech isn't the only way to go, oh no. For your little ones' very beginning stages, sometimes just getting a move-on is what they need. We offer a crazy-big assortment crawling toys, push toys and pull toys (all of which, of course, are crazy-cute). And not to be a bunch of divas and sing our own praises about all our musical toys, but if the shoe fits...which is a fitting segue for our next point: Our colorful sorting toys are a great way to help kiddies learn what fits where and why. So just to reiterate, Target offers loads upon loads of learning toys in all shapes and sizes. We've learned that it's the smart thing to do.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 696, "catid": 125, "level": 0, "url": "http://www.target.com/c/toys-outdoor-toys/-/N-5xtai", "text": "outdoor toys", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "Outdoor fun and games are essential for growing kids. Fresh air and recreational activities can be both invigorating and beneficial. Target offers a full range of exciting, outdoor toys that have been specially designed to keep kids entertained. Take your pick from outdoor-toy favorites like bouncing balls, pogo sticks and ball pits to get the party started. If you are planning an outdoor birthday party, a bubble machine is a must-have. Lawn game collections include ladder ball, bean-bag toss, croquet and so much more. We also believe that outdoor creativity can be fun for kids. Our activity tables and sandboxes are favorites. Of course, traditional, outdoor play equipment and toy sets never lose their charm. Riding toys , swing sets, slides, seesaws and monkey bars will keep your kids fit and active. When winter comes, snow tubes, sleds and snow toys let them enjoy the weather. Trampolines are one of our most popular outdoor toys. We offer several types in different shapes and sizes to conveniently fit in your backyard or patio. If they need a break, our kid pools are a refreshing and relaxing, good time. Don't forget the noodles, floaties and water slides . The fun never stops at Target.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
