{"nr_products": 542, "catid": 173, "level": 0, "url": "http://www.target.com/c/boys-clothing-kids/-/N-5xty4", "text": "clothing", "department_url": "http://www.target.com/c/kids/-/N-5xtyp", "parent_url": "http://www.target.com/c/kids/-/N-5xtyp", "description_wc": 0, "description_text": "We know how it goes when it comes to shopping for boys. So we\u2019re prepared with every kind of outfit to match your boy\u2019s sense of style. Whether you want matching separates, outerwear or school uniforms, we\u2019ve got what he needs. Tees , shirts, hoodies , pants and shorts in a variety of styles and colors are available. Is your child the outdoorsy type? Check out our selection of boys\u2019 activewear for athletic tees, running shorts, denim jeans and more. Who said formal wear is for dads only? Our selection of dress pants and formal shirts will make your boy look seriously stylish. We\u2019ve also got an impressive selection of sleepwear, robes and pajamas designed for your growing, young man. From warm footed sleepers to character-based pajamas, Target has tons of fun and comfortable sleepwear. When it comes to brands, there\u2019s a lot to choose from. We have outfits from C9 by Champion , Circo , Cherokee, dENiZEN by Levi's and lots more. Whether he likes to dress up or down, Target\u2019s got the style, brand and selection to handle his tastes.", "parent_text": "kids", "parent_catid": 22, "department_text": "kids", "department_id": 4},
