{"nr_products": 124, "catid": 1135, "level": -1, "url": "http://www.target.com/sb/kids-tablet-accessories-learning-toys/-/N-5xt9x", "text": "kids' tablet accessories", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "parent_url": "http://www.target.com/c/toys-kids-electronics/-/N-5xt9q", "parent_text": "kids' electronics", "parent_catid": 123, "department_text": "toys", "department_id": 16},
