{"nr_products": 729, "catid": 1204, "level": 0, "url": "http://www.target.com/c/action-figures-playsets-toys/-/N-5xt88", "text": "action figures & playsets", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "The thing about action figures is, the more there are to choose from, the more fun there is to be had. And Target offers a ginormous assortment of fun. First of all, there's one of the biggest superheroes ever: Spider-Man. What a tangled web our selection weaves, with everything from Spidey himself to his archenemies. Meaning, of course, that your little ones can stage the best battles in the whole wide webbed world. And for players who prefer their crusaders caped, we've got the one and only Batman. And not just the beloved B-man himself, but also his favorite ways to fly: Batmobiles and Batpods. Our selection saga continues with the force of stellar Star Wars action figures from all the hit movies. You'll find all the favorites, from R2D2 to Mace Windu, and generations of fun in between. And for those into the more earthly super beings, we carry the earth's mightiest heroes, The Avengers. Speaking of heroes, how about that GI Joe guy? We've got everything from the main man himself to his bikes, boats and cohorts, like Snake Eyes. Fun fact: GI Joe's loved by so many that he was inducted into the National Toy Hall of Fame in 2003. Now that's love. And another thing: Calling all Transformers fans! There's loads to love about our selection of those bad boys, along with all the others. Ready, set, action figures.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 794, "catid": 1205, "level": 0, "url": "http://www.target.com/c/arts-crafts-toys/-/N-5xt8k", "text": "arts & crafts", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "They say imagination is the greatest key to success. The arts and crafts products offered at Target are designed to nurture the creative minds of the future. We value inspiration and encourage it with our collection of craft, painting and sewing kits. Most little hands love to get dirty. Why not turn their enthusiasm into something fun and constructive? We have an assortment of clay, dough and pottery kits to ignite their artistic flair. Our drawing boards , brush sets, crayon and marker packs from top brands like Crayola and Fisher-Price are designed for the next little da Vinci in the making. For more experienced little artists, our easels, activity desks and studio stations come in handy. Let kids immerse themselves in arts and crafts activity kits like casting, wax molding, creating fashion portfolios, designing totes, robotics and more. They may also enjoy trying their hand at design with our jewelry-making kits. Scrapbooking their fun moments and memories is a great way to keep the magic alive. Make it a group project for some added fun. During the school year, Target has you covered with an extensive range of arts and crafts supplies for projects, reports and fairs.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 794, "catid": 1206, "level": 0, "url": "http://www.target.com/c/building-sets-blocks-toys/-/N-5xt8r", "text": "building sets & blocks", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 1339, "catid": 1207, "level": 0, "url": "http://www.target.com/c/dolls-toys/-/N-5xt90", "text": "dolls", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "At Target, we love dolls so very much\u2014it's why we carry so very many. First off, there's one of the most famous dolls of all, Barbie. With all the top Barbie toys ranging from dream homes to dolls, and with dolls ranging from mermaid collector editions to that handsome devil, Ken, there's some fun for every imagination. Here's a little factoid that even the most avid fans might not know: The blond icon's middle name is Millicent. Yeah, pretty fancy. And fancy this: There's so much Monster High stuff here, it's scary. There are droves of dolls (plush ones even) from Cleo de Nile to Laguna Blue, and other goodies from hair chalk to costumes, so your little ones' options for pretend play go on and on. And continuing the pretend play are oodles of Our Generation dolls and accessories, as well as loveable Lalaloopsy rag dolls (formerly known as Bitty Buttons, FYI). Now, about that Disney Brave: Girl power rules! Here you'll find bundles of Brave dolls, jewelry, books, play sets and costumes to get creative with\u2014not to mention our sweet selection of Disney Princess fun from Baby Belle to Toddler Tiana. Lastly, home might be where the heart is, but Target is where the dollhouses are. Seriously, you'll see everything from little Smurf cottages to big princess palaces. Okay, kids, time to get dolled up.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 812, "catid": 1208, "level": 0, "url": "http://www.target.com/c/dress-up-pretend-play-toys/-/N-5xt99", "text": "dress up & pretend play", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "Let's pretend your little ones could be anyone in the whole wide world. Anyone. We don\u2019t know who they'd be, but whoever it is, we're pretty sure Target has kids' costumes for it. Our getups run the gamut from pretty princesses\u2026or is it princi?\u2026to rad racecar drivers, superheroes, police officers and doctors. And what goes better with a cute little white coat than a top-notch toy doctor play set? But we realize not everyone wants to be a doctor. For those who prefer a nice set of cooking utensils to surgical instruments, we have a delectable selection of toy kitchens\u2014along with entire playhouses. Fun, fun and more fun. Moving on now to escapes for the outdoorsy types, you'll find all sorts of play tents in all sizes, adorned with all their favorite characters. Lots of toy gardening sets, too, for little green thumbs. The gardening sets are super fun. Plus, what a great way to teach your kids about the importance of fresh produce in their diet. Okay, that concludes our public service announcement for today. But seriously, Target has pretend play fun for techies, too: There's spy gear like night vision goggles and fingerprint kits, and toy cell phones for chatty little Cathys and Charlies to practice their communication skills. So, to sum it all up, Target has a whole lot of pretend play and dress up fun for every kind of imagination. Imagine that.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 562, "catid": 1209, "level": 0, "url": "http://www.target.com/c/games-puzzles-toys/-/N-5xt9i", "text": "games & puzzles", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 589, "catid": 1210, "level": 0, "url": "http://www.target.com/c/kids-electronics-toys/-/N-5xt9q", "text": "kids' electronics", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "Kids love things that take batteries, it's a proven fact. They love things that beep, things that buzz, things that blink\u2014it's just their way. They all go crazy for electronic toys, and who can blame 'em? We here at Target certainly can't. We go gadget-crazy, too, as you'll see once you get a load of our huge assortment for kids of all ages. Take the mega-loved LeapFrog for instance: We carry their electronic toys for kiddies from baby up through 11 years, so there's something for every growing mind. You'll find LeapFrog software and learning systems, along with the very cool VTech. Speaking of very cool, have you heard of the new AppBlaster? It's an interactive toy gun that works with your iPhone or Android smartphone, and lets kids 8 years and up play some of the coolest apps ever. Shoot, that's fun stuff. Something else that everyone's talking about: Colorful micro-robotic creatures called Hexbugs. In addition to the mechanical insects and other heebie jeebie-inducing critters, you'll find loads of play sets for them to crawl on. And for the squeamish types, the fabulous Fijit Friends Newbies might be a better fit. These little interactive cuties unlock content on their very own website\u2014but that's not all they do. They also sing even perform duets with other Newbies. And to that, we say bravo.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 824, "catid": 1211, "level": 0, "url": "http://www.target.com/c/learning-toys/-/N-5xta7", "text": "learning toys", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "The more fun you can feed a growing mind, the better. And there's lots to learn about all the learning toys Target carries to help those hungry little minds develop. For starters, there's the much-loved LeapFrog. At Target, you'll find all the best stuff from them: There's LeapFrog software and loads of learning books, along with superstar systems like Leapster Explorer, My Own Leaptop, Tag Reading, Text & Learn, LeapPad and more. And there's way more to learn, too, with the very cool VTech toys. From them, you'll see systems like VTech Touch, ABC Text & Go, MobiGo Touch, InnoTab Learning App Tablet and V.Reader Interactive E-Reading. But high tech isn't the only way to go, oh no. For your little ones' very beginning stages, sometimes just getting a move-on is what they need. We offer a crazy-big assortment crawling toys, push toys and pull toys (all of which, of course, are crazy-cute). And not to be a bunch of divas and sing our own praises about all our musical toys, but if the shoe fits...which is a fitting segue for our next point: Our colorful sorting toys are a great way to help kiddies learn what fits where and why. So just to reiterate, Target offers loads upon loads of learning toys in all shapes and sizes. We've learned that it's the smart thing to do.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
{"nr_products": 696, "catid": 1212, "level": 0, "url": "http://www.target.com/c/outdoor-toys/-/N-5xtai", "text": "outdoor toys", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "description_text": "Outdoor fun and games are essential for growing kids. Fresh air and recreational activities can be both invigorating and beneficial. Target offers a full range of exciting, outdoor toys that have been specially designed to keep kids entertained. Take your pick from outdoor-toy favorites like bouncing balls, pogo sticks and ball pits to get the party started. If you are planning an outdoor birthday party, a bubble machine is a must-have. Lawn game collections include ladder ball, bean-bag toss, croquet and so much more. We also believe that outdoor creativity can be fun for kids. Our activity tables and sandboxes are favorites. Of course, traditional, outdoor play equipment and toy sets never lose their charm. Riding toys , swing sets, slides, seesaws and monkey bars will keep your kids fit and active. When winter comes, snow tubes, sleds and snow toys let them enjoy the weather. Trampolines are one of our most popular outdoor toys. We offer several types in different shapes and sizes to conveniently fit in your backyard or patio. If they need a break, our kid pools are a refreshing and relaxing, good time. Don't forget the noodles, floaties and water slides . The fun never stops at Target.", "parent_text": "toys", "parent_catid": 116, "department_text": "toys", "department_id": 16},
