{"nr_products": 1049, "catid": 1609, "level": -1, "url": "http://www.target.com/c/ipods-audio-electronics/-/N-5xte2", "text": "iPod & audio", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/kids-electronics-toys/-/N-5xt9q", "description_wc": 0, "description_text": "Get the best selection of Apple iPods, headphones and other audio devices all in one place. We have the top-rated audio electronics, so you can always listen to your favorite music, wherever you are. The boombox has made a comeback. Today's streamlined & portable models express your individuality. And when you want to listen privately, headphones and earphones are perfect choices. Take your pick from classic over-the-head or over-the ear headphones from top brands like Beats By Dre , or ones with snug-fitting, noise-canceling rubberized earbuds . iPod and MP3 players are always in style. Popular brands like Apple and Sansa offer players that are user-friendly, compact and lightweight. Of course, we can't talk about audio equipment without mentioning Bose and Jawbone portable speaker systems. Whether you want to share your music or keep it private, you'll find the right set-up at Target. For enjoying music on-the-go, portable, rechargeable, Bluetooth and wireless speakers from brands like iHome and SONOS are making a place for themselves in the market. You can even infuse some vintage-style entertainment in your home with a turntable. There's nothing like vinyl to get you feeling a little retro! Our alarm clocks with speaker docks do double-duty. Their multi-purpose designs free up premium dresser, desktop or nightstand space. Don\u2019t forget to check out our audio accessories like connector cables, USB chargers, iPod cases and screen protectors. Target has the audio devices you need to stay wired for sound.", "parent_text": "kids' electronics", "parent_catid": 1210, "department_text": "toys", "department_id": 16},
{"nr_products": 124, "catid": 1610, "level": -1, "url": "http://www.target.com/c/remote-controlled-vehicles-animals-radio-control-toys/-/N-5xtav", "text": "remote-controlled toys", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "description_wc": 0, "parent_url": "http://www.target.com/c/kids-electronics-toys/-/N-5xt9q", "parent_text": "kids' electronics", "parent_catid": 1210, "department_text": "toys", "department_id": 16},
{"nr_products": 1860, "catid": 1611, "level": -1, "url": "http://www.target.com/c/video-games-electronics/-/N-5xtg5", "text": "video games", "department_url": "http://www.target.com/c/toys/-/N-5xtb0", "parent_url": "http://www.target.com/c/kids-electronics-toys/-/N-5xt9q", "description_wc": 0, "description_text": "Want to play a video game? Yay! You pick which one. Oh\u2026you want Pong? Well, that was really cool back in 1972, but the gaming industry's actually made some advances in the last 40 years. Seriously, you should see all the great video games that Target carries these days. You'll find Xbox games , PS3 games and Nintendo Wii games in a genre for every mood: there's action, adventure, dance, family, fighting, music, racing and sports\u2014along with the hottest new releases and pre-order titles. And there are even portable consoles now like PSP (short for PlayStation Portable), so gamers can take their fun anywhere. And the traditional consoles have advanced so much that they can work with sensors now to see your motion, so you don't even need controllers anymore. (Controllers are updated joysticks, just in case you were wondering). If you're on an Xbox 360 and you get the Kinect Sensor, you can play up to 6 feet away. Or working with the PlayStation 3 console (also known as PS3 ), the PlayStation Eye Camera sees you from 3\u201310 feet away\u2014those games are called PlayStation Move. Or maybe you want to get a move on with that PlayStation 4 (also known as PS4 ) or Xbox One everyone's been talking about. On the Nintendo Wii U the sensor is built in, so you don't need a separate accessory for that one. And here's something else about those consoles: They all stream video and even Netflix. But yes, Pong was very cool.", "parent_text": "kids' electronics", "parent_catid": 1210, "department_text": "toys", "department_id": 16},
