{"nr_products": 653, "catid": 1970, "level": 0, "url": "http://www.target.com/c/cameras-camcorders-electronics/-/N-5xtez", "text": "cameras & camcorders", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Strike a pose! Do you love to capture every moment on camera? Then you've landed on the right page. At Target, you\u2019ll find every kind of camera from point-and-shoot to high-tech DSLR cameras. Digital cameras are super easy to use and are perfect for parties, holiday gatherings and traveling. Point-and-shoot cameras are compact and user-friendly enough that you can count on getting the shot. Go for a durable camera if you're an adventure seeker. Many models can withstand a dunk in the water or a drop on the ground. When convenience is a priority, Wi-Fi cameras upload images directly to your laptop or smartphone. Instantly share pics with your family and friends, and lose the messy wires and extra adapters. We haven't forgotten about you serious, professional photographers out there. Target has a variety of sophisticated digital SLR cameras for you, too. Check out our selection of high-end DSLRs from Nikon , Canon and Sony . We also have optical zoom cameras and interchangeable camera lenses . A picture says a thousand words, but a video captures every detail. Take amazing videos with crystal-clear audio with our camcorders. From DVRs to palm-sized handheld camcorders, you'll find the features you need to suit your lifestyle perfectly. Check out our extensive assortment that also includes photo printers, binoculars, security cameras, camera cases and other accessories.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 1294, "catid": 1971, "level": 0, "url": "http://www.target.com/c/cell-phones-electronics/-/N-5xte8", "text": "cell phones", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "A cell phone is your best friend, it\u2019s your identity, it\u2019s YOU! Gone are the days when these mobile devices were just to make calls or send text messages. Today\u2019s hi-tech smartphones are magical. From surfing the web and checking mail to streaming videos and locating a street on the other side of the globe, you can do anything and everything with a smartphone. Get yours today at Target! Whatever be your favorite brand, we have them all. Find brands like Nokia, Blackberry, HTC, Virgin, Samsung, LG, Motorola and more here. Looking for cell phones with plans from AT&T, Sprint, T-Mobile and Verizon Wireless or unlocked phones from top-selling brands? We have you covered. For those who love to explore thousands of exciting apps, Android phones like Samsung Galaxy are a great choice. Prefer style and sophistication? The Apple iPhone is just made for you. Here at Target, we just don\u2019t stop with cell phones; you\u2019ll also find a whole new range of accessories like Bluetooth headsets, chargers, adapters, screen protectors and more. Be it for an extra layer of protection or adding a touch of fashion, you\u2019ll find attractive and stylish cases for your iPhone, Windows or Android smartphone. We know it\u2019s fun to own the latest smartphone in the market, and Target adds to the excitement with super-cool online deals and discounts. So, why wait? Pick your favorite cell phone along with the right accessories and get ready to explore the endless possibilities of the mobile world.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
{"nr_products": 1289, "catid": 1972, "level": 0, "url": "http://www.target.com/c/computers-office-electronics/-/N-5xtfc", "text": "computers & office", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Computers are a must-have. Target offers a whole range of laptops and tablets for personal and professional use. Take your pick from some of the top brands in computers like Apple , Acer and Samsung and always be connected. Tablets are perfect for lovers of multimedia. With anywhere from 16 to 128GB, the Apple iPad is one of our bestsellers. We also offer several top-rated tablets that are perfect for gaming, shopping, reading and watching movies anywhere, anytime. Kids' tablets are also in high demand. LeapFrog , VTech and Camelio have launched tablets for kids to keep them occupied with their favorite learning and educational games or videos. This gives them their own equipment, and most options come pre-loaded with excellent parental controls. A laptop is an essential gadget that you can't go without. Before buying, it's smart to know yours needs and compare specs. At Target, we cater to diverse system requirements with our large collection of laptops, integrating a variety of features. If you love to read, our NOOK eReaders are the way to go. But if video games are your calling, our desktops and computers will blow your mind with their amazing graphics and special effects capabilities.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
