{"nr_products": 1049, "catid": 1976, "level": 0, "url": "http://www.target.com/c/ipod-audio-electronics/-/N-5xte2", "text": "iPod & audio", "department_url": "http://www.target.com/c/electronics/-/N-5xtg6", "parent_url": "http://www.target.com/c/electronics/-/N-5xtg6", "description_wc": 0, "description_text": "Get the best selection of Apple iPods, headphones and other audio devices all in one place. We have the top-rated audio electronics, so you can always listen to your favorite music, wherever you are. The boombox has made a comeback. Today's streamlined & portable models express your individuality. And when you want to listen privately, headphones and earphones are perfect choices. Take your pick from classic over-the-head or over-the ear headphones from top brands like Beats By Dre , or ones with snug-fitting, noise-canceling rubberized earbuds . iPod and MP3 players are always in style. Popular brands like Apple and Sansa offer players that are user-friendly, compact and lightweight. Of course, we can't talk about audio equipment without mentioning Bose and Jawbone portable speaker systems. Whether you want to share your music or keep it private, you'll find the right set-up at Target. For enjoying music on-the-go, portable, rechargeable, Bluetooth and wireless speakers from brands like iHome and SONOS are making a place for themselves in the market. You can even infuse some vintage-style entertainment in your home with a turntable. There's nothing like vinyl to get you feeling a little retro! Our alarm clocks with speaker docks do double-duty. Their multi-purpose designs free up premium dresser, desktop or nightstand space. Don\u2019t forget to check out our audio accessories like connector cables, USB chargers, iPod cases and screen protectors. Target has the audio devices you need to stay wired for sound.", "parent_text": "electronics", "parent_catid": 103, "department_text": "electronics", "department_id": 14},
