{"nr_products": 1324, "catid": 3057, "level": 0, "url": "http://www.target.com/c/bath-home/-/N-5xtvc", "text": "bath", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Bathroom accessories are just what you need to make the right statement in your bath. Whether it's a full, half, master, kids' or guest bath, your accessories from Target will help create the perfect look. There's so much to choose from that you may find yourself wishing for additional baths to decorate. Just sayin'! Luxuriously soft bath rugs and toilet covers in amazing palettes of color await! You will be hard-pressed when it comes to selecting coordinating towels. Will you choose the pretty prints, dramatic dots, or crazy character prints? Or will you go for the microfiber solids or colorful stripes? Shower curtains will tie the whole look together. With dozens of choices in floral, geometric patterns and more, your curtains will jazz up your bathroom. Ready to revamp your bath? Bathroom mirrors in a variety of sizes, shapes, styles and finishes will help create light and ambiance. You can never have too much storage, right, ladies? Bathroom furniture consisting of wall cabinets, floor cabinets and medicine chests will provide the room you need to keep your supplies organized and out of sight. Did we cover everything? Not even close! There is so much more. You name it, we have it! So, out with the old and in with the new from Target!", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 1441, "catid": 3058, "level": 0, "url": "http://www.target.com/c/bedding-home/-/N-5xtv4", "text": "bedding", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Planning to revamp your little one's room? Shop at Target for an exclusive collection of decorative kids' bedding and give his bedroom the perfect room makeover. How about a complete bedding set in a theme your kiddo will love? From polka dots and stripes to peace signs and pirates, we have coordinating collections of sheets, pillowcases and blankets to crank the \"cool\" factor up a notch. Most kids have their own favorite cartoon or movie characters. How about a bedroom d\u00e9cor that lives up to their fascination? Your little Jedi will think our Star Wars themed bedding is out of this world. And your sweet little explorer will love to snuggle up with Dora every night! You can also mix and match our duvets and quilts with our wide assortment of bedskirts, sheets and pillowcases to create your own look. How about a ballerina theme for the little dancer? Or maybe sports theme for the future quarterback in your family? Top off the look with our decorative pillows to add the perfect finishing touch. Kids can fall asleep just about anywhere. (Not when you tell them to of course, that would be too easy!) But for the unexpected snoozer in the family, choose one of our kids' nap mats for napping on the go. And how about our blankets and throws for an impromptu cuddle fest? Plush and soft \u2013 they're irresistible! Whether you have a toddler or a teen or anything in between, Target has awesome bedding choices that are cool, stylish and rocking!", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 2391, "catid": 3059, "level": 0, "url": "http://www.target.com/c/dining-entertaining-home/-/N-557t7", "text": "dining & entertaining", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 4459, "catid": 3060, "level": 0, "url": "http://www.target.com/c/furniture/-/N-5xtnr", "text": "furniture", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Moving into a new home feels great, but furnishing your home makes it uniquely yours! Whether you're setting up your new home from scratch or upgrading the decor, Target has just what you need. Shop our home furniture collections to find the perfect pieces for any room. From the foyer to the bedroom and everything in between, decorate your entire home with furniture to suit your tastes and your lifestyle. Simple or bold, classic or contemporary, whatever your style, we've got you covered. Is storage a concern? We have a smart assortment of home furniture that gives your home a stylish touch with convenient storage options. These space-saving pieces include armoires , open shelving, closed cabinets, bookcases , storage benches, and media stands. If color is your passion, try some of our full-color favorites in reds, yellows, greens and more. You\u2019ll find bright accent chairs, counter stools, side tables, dining chairs and an endless list of accessories in a variety of hues. Add the right type of home furniture to make the most of your space. From futons , swoop chairs and coffee tables for the living room, den or family room to dining sets, kitchen tables and benches, Target has every style of home furniture to suit your needs.\u00a0 Don't forget our furniture collections for home office, kids\u2019 rooms, bathrooms and bedrooms. From towels to linens, accessories and office equipment, you'll find what you need to make your house a home in one convenient place. Begin your furniture search at Target and you'll spend less time hunting and have more time to enjoy your fabulous furniture finds.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 944, "catid": 3061, "level": 0, "url": "http://www.target.com/c/home-appliances/-/N-5xtuu", "text": "home appliances", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Target redefines smart living with our home appliances. We help you customize your indoor environment with our high-performance heaters and humidifiers, so you'll stay warm and comfortable during the chilly months. When summer is at its peak and cool air is a must-have, our air conditioners, dehumidifiers and fans can turn stuffy indoors into a comfy place to relax. Our weather instruments give you the indoor and outdoor temperature, humidity, amount of rainfall and more, all at just a quick glance. If eliminating odors and improving your indoor air quality is a priority, check out our air purifiers from top-selling brands like Honeywell and Germ Guardian. We know a clean home is a healthy home, and that's why we\u2019ve got everything from steam mops to sweepers to help you keep your home spotless. Whether it's a soiled rug or a spill on your hardwood floor, our vacuums and floor care products will get the job done. Target also has fabric steamers, irons and ironing boards, sewing machines and many more handy appliances. Shop Black & Decker , Conair, Whitmor, Panasonic and other top brands to help keep your clothes looking new. Do you need a convenient laundry station for your second floor, garage or mudroom? Choose from reliable and compact washing machines and dryers from brands like Haier. Get these must-have appliances from Target and keep your home comfortable and healthy.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 6764, "catid": 3062, "level": 0, "url": "http://www.target.com/c/home-decor/-/N-5xtub", "text": "home decor", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Looking to update your home d\u00e9cor? You can decorate your home from attic to basement with the selections from Target! Our lamps and lighting will help you create any mood you desire in any room in your home. If you need a little task lighting in your kitchen and dining room, or perhaps a little mood lighting in your bedroom, we've got it under control! Create a little ambiance with deliciously intoxicating candles and scents. Pick up fun, funky decorative accents for a fresh look. Target has an extensive selection to appeal to a variety of tastes. Mirrors are a creative way to give an illusion of more space. Target has mirrors in a variety of shapes, with frames or without, to suit any d\u00e9cor. Photo frames, sconces and wall d\u00e9cor items are the perfect way to make your house a home. Want to create a new look in your dining or living room? Try our slipcovers! Cover worn chairs with stretchy or draped fabrics for a dramatic transformation. If you're on a budget, this is an ideal way to jazz up your home for less! Add a few strategically placed rugs throughout the home and a few pillows and throws onto the couches or chairs to breathe new life into existing color schemes. You can complete the look with new curtains and blinds. Target is just what you need when you're designing or redecorating your home. The home d\u00e9cor pieces also make perfect housewarming gifts.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
