{"nr_products": 1655, "catid": 3074, "level": 0, "url": "http://www.target.com/c/home-improvement/-/N-5xtt9", "text": "home improvement", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "If you're looking to completely overhaul your home, or just make a few minor changes, Target has what you need to get the job done your way. From power tools to cleaning products, Target is the answer to all of your home improvement needs. Whether your cabinets need a facelift by adding stylish knobs and pulls, or you want to install motion detector lights or an alarm system, we've got everything you need. Create a comfortable home environment with our space heaters , air purifiers, humidifiers , air conditioners and fans. To clean up spills and keep things tidy, we offer a variety of cleaning products from wet/dry vacuums and brooms, to mops and all-purpose cleaners. Change things up a bit with wallpaper, contact paper and repositionable wall d\u00e9cor. A toolbox is a do-it-yourselfer's best friend. Target has hand tools ranging from screwdrivers to wrenches to keep your toolbox well stocked and ready for any type of repair. From interior and exterior paint, duct tape, masking and painter's tape to tape measures and levels \u2013 we have them all. You'll also find flashlights, headlamps and work lights for working in low-light areas. If you're working on ceilings, gutters or roofs, our step stools and ladders will give you a boost to get the job done. Complete your home improvement projects with supplies from Target today.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 4065, "catid": 3075, "level": 0, "url": "http://www.target.com/c/kitchen-dining-home/-/N-5xtsc", "text": "kitchen", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "So we got a new cookbook and want to try out some of the recipes. Are you free Saturday night? Great\u2014dinner party at Target! Any food restrictions? Oh, you don't do meat, shellfish, carbs, dairy, gluten, nuts or sugar? And you're in an \"orange food only\" phase? No problem, we've always thought the other 99.9% of food is overrated anyway. And just bring yourself because we've got everything else covered. Here you'll find all the cool kitchen appliances, kitchen tools, kitchen gadgets, and kitchen cutlery and knives you could ever want for fast and easy food prep. Speaking of things with blades, here's something to sharpen your kitchen trivia skills: Stamped knives cost less than those with handcrafted forged blades, but the forged ones are stronger, more comfortable, and safer to use. However you cut it, though, we've got a huge selection of all kinds. And we carry a crazy-big assortment of cookware and bakeware, too, including great collections from your favorite foodies like Giada, Paula and Rachael. Now let's talk organizational skills. To help you make the most of your kitchen space, we offer tons of smart solutions for kitchen storage and organization, along with cute aprons and kitchen towels in a rainbow of colors. And we'll help set the table with a delectable selection of stylish table linens, dinnerware, glassware and drinkware, flatware and silverware sets\u2014ranging from four to twelve settings\u2014with something for every taste and budget. Dig in.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 4336, "catid": 3076, "level": 0, "url": "http://www.target.com/c/patio-garden-home/-/N-5xtq9", "text": "patio & garden", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Cooking, storage and relaxation are not just part of indoor living, the world is changing and it\u2019s great to bring the fun outdoors. Target has an extensive range of outdoor furniture and patio accessories including heaters, fire pits and coolers to get your patio ready to roll, no matter what the season. If entertaining guests is something you do often, you\u2019ll love our outdoor grills , BBQ tool sets and carts. After all, it\u2019s good to call up friends every now and then for a grill party and board games - an easy way to melt away stress. Not just that, we also have super cozy patio furniture to set the stage for the big night. Cushions, pillows, umbrellas, canopies and a whole lot of patio accessories for setting up the perfect outdoor party. So why wait, just let the party animal in you go wild, all in the comfort of your backyard! Whether you want to mix and match for a personalized touch or give your patio a coordinated look \u2013 just take your pick from individual furniture pieces or opt for a patio furniture set. Either way, Target has it all. Is gardening more than just a hobby for you? Target also brings you all sorts of gardening tools, hoses and sprinklers for the DIY types like you to beautify your outdoor space.", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
{"nr_products": 1456, "catid": 3077, "level": 0, "url": "http://www.target.com/c/storage-organization-home/-/N-5xto8", "text": "storage & organization", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home/-/N-5xtvd", "description_wc": 0, "description_text": "Tired of spending your free time looking for the thing you want to spend your free time using? Well, it's Target to the rescue! Stuff your stuff into our stuff and get organized with our vast array of home storage and organization solutions. Target's organizers can help you get it all together and keep it there! We've got media storage the whole family can love, from classy Case Logic to funky Discgear. Easily access your movies, music, photos and games with our CD/DVD cases, boxes, towers, wallets and sleeves. Need a place for accessories? Check out our storage furniture. How about a bench or ottoman that doubles as a trunk? We've got brightly colored storage units for kids' rooms, flexible fabric for closets and under the bed, baskets for your bangles and shelving for your shoes. If you've got it, Target has a place for it! Whatever your decor, we've got affordable storage & wall cabinets to match. Find them with wood finishes, metal shelves or glass fronts; they come with cubes, shelves, drawers, doors and baskets. Large or small, you're sure to find the perfect fit for every room. We even have smartly designed garage storage units to help you put your tools and supplies in order while making space for more stuff! And don't forget the laundry. Conquer your mountain of mess with our clever laundry solutions. And while you still have to empty the garbage, Target's selection of trash cans & bins makes it SO much nicer!", "parent_text": "home", "parent_catid": 57, "department_text": "home", "department_id": 7},
