{"nr_products": 203, "catid": 3101, "level": -1, "url": "http://www.target.com/c/curtains-blinds-shades-home-decor/-/N-5xtu4", "text": "curtains, blinds & shades", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home-home-d\u00e9cor/-/N-5xtub", "description_wc": 0, "description_text": "Looking for a quick and easy way to give your home a brand new look? Check out the vibrant curtains, blinds and shades offered at Target! We have chiffon window sheers, woven damask window valences, and faux silk window panels to suit every taste. Our pretty window blinds are easy to operate, so you can let sunlight pour in or change your clothes in private with an easy pull of a cord. And dust? No worries! These blinds are vinyl-based for easy cleaning. Neighbor's barking dog or screaming kids keeping you awake? Try our noise-reducing window curtains that shut out all loud noises, letting you sleep like a baby. We also have curtains in pleated and honeycomb styles for parents looking to revamp their little angel's room. While you're at it, why not tackle other rooms as well? Live like celebrities! Touch up your home windows with our twinkling Xhilaration window panel sequins. You can also find loads of goodies to refresh your exterior space. Experience the best of both worlds with our weather-resistant window panels! Enjoy lazy summer evenings relaxing in your outdoor patio protected by our roll-up blinds. And don't worry about installation. We also provide the required mounting hardware and curtain accessories. Deck your home with window treatments from Target!", "parent_text": "home d\u00e9cor", "parent_catid": 61, "department_text": "home", "department_id": 7},
