{"nr_products": 864, "catid": 3109, "level": -1, "url": "http://www.target.com/c/lamps-lighting-home-decor/-/N-5xttm", "text": "lamps & lighting", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home-home-d\u00e9cor/-/N-5xtub", "description_wc": 0, "description_text": "Looking for lighting fixtures for your new house? Or racking your brain on how to brighten up your office space? We can shed some light on your decision! We have wooden desk lamps for a formal office setup, off-beat stick lamps to spruce up a dorm room, pendant lamps to add a dramatic touch in the kitchen and so much more! Lighting can be used to change the entire look and feeling of a room. We have oodles of lamps and lighting solutions to not only provide illumination, but to also help you set just the right mood. While you are revamping your tween's room with a brand new look, you'll be bowled over by the assortment we have to offer. From funky lava lamps to swanky chandeliers, we have it all. And for parents looking to decorate a little one's room, we have an exclusive collection of kids' lamps with fun themes ranging from Toy Story to Hello Kitty and a huge assortment of table lamps and night lights that will surely add the perfect finishing touch to a nursery. Browse through our collection to find floor lamps that will elegantly blend with your timeless furniture. You can even create a custom look with our brilliant selection of mix and match lamp shades and bases. The possibilities are endless with the ability to combine different materials, textures and colors to complement the setting of any room. Our collection is sure to light the way to an instant home makeover!", "parent_text": "home d\u00e9cor", "parent_catid": 61, "department_text": "home", "department_id": 7},
