{"nr_products": 1565, "catid": 3159, "level": -1, "url": "http://www.target.com/c/wall-decor-home/-/N-5xtte", "text": "wall decor", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home-home-d\u00e9cor/-/N-5xtub", "description_wc": 0, "description_text": "Some people say that walls have ears but with a little help, they'll do all the talking instead! Spice up your space with contemporary paintings and framed art or add a fun touch with d\u00e9cor posters and murals. We also have wall clocks , wall frames, shelving and lights for decking up the interior space. Got kids at home? Then go for our cartoon-character inspired wall decals. Your kids will love the cute pictures and have a great time showing them off to their friends. And the best part is that they go on easy and come off clean. Do you know that you can create the right mood in a room with a few lights and a mirror? Place a sconce or two in corners or near an entrance and use a mirror to add the illusion of space and reflect light. Turn the lights up to create a bright and lively atmosphere. In a romantic mood? Just reach for the dimmer. Bring neglected corners into the limelight with decorative shelves that hug the curves and maximize space. Classic shelves, floating shelves, corner shelves, wall cube sets \u2013 we've got all you need to display your collection of books, media or showpieces. On a budget? No worries. We have stuff priced just perfect to fit your wallet and your style. Whatever be the need or the mood, there's surely something for you at Target. Spruce up the walls with these incredible wall art items that say, \"You're home.\"", "parent_text": "home d\u00e9cor", "parent_catid": 61, "department_text": "home", "department_id": 7},
