{"nr_products": 464, "catid": 3415, "level": -1, "url": "http://www.target.com/c/rugs-home-decor/-/N-5xttg", "text": "rugs", "department_url": "http://www.target.com/c/home/-/N-5xtvd", "parent_url": "http://www.target.com/c/home-decor/-/N-5xtub", "description_wc": 0, "description_text": "Get out and cut a rug with Target! From plain borders to elegant Persian area rugs, we've got your floors covered with sizes, shapes, colors and designs for every taste and space. Redefine a room in an instant with our huge selection of accent rugs. Chunk up a space into cozy nooks or tie one all together, add drama, tone down a busy area with a focal point, create continuity or define a boundary. The right rug can add luxury and intimacy to your conversation space. Fancy yourself the Barefoot Contessa? Our kitchen rugs are waiting for you! Use a runner rug to warm up (and quiet down) a hallway. Add a non-slip rug pad to keep it in place. Like your surroundings natural? Check out our collection of wool, cotton and jute fiber rugs. For easy cleaning, try our great looking synthetics that are resistant to stains, mildew, abrasions and fading! Create a soft landing for your little adventurers when you decorate the playroom with one of our lively designs created just for kids. Roll out the welcome wagon with a worded doormat that says it all. Be it a formal party or a family celebration, dress up the entrance with your own special sentiment. From eye-popping \"wow!\" to understated elegance, there's so much to choose from. We even created a handy rug-buying guide to help you get started. So what's the wait for? Start shopping for rugs at Target today!", "parent_text": "home decor", "parent_catid": 3062, "department_text": "home", "department_id": 7},
