{"nr_products": 503, "catid": 4119, "level": 0, "url": "http://www.target.com/c/activity-gear-toys-baby/-/N-5xtjv", "text": "activity & playtime", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "What\u2019s playtime without baby toys? From infancy to childhood and sometimes even later, toys are a kid\u2019s best friend. They open up a world of imagination. Double up your little one\u2019s playtime fun with the exclusive toy collection available at Target. Whether meek or mischievious, we have toys for every baby. With our huge collection of bouncers and rockers , playtime fun starts from day 1. Few things can fascinate your newborn more than a rattle. To add to the fun, we offer rattles that double as a teether to soothe tender gums. While you need activity toys to entertain during the day time, you\u2019ll simple love our soothers to keep them company at nights. These musical toys play lullabies and make natural sounds to get them ready for bedtime, or a couple of super-soft baby plush toys might do the trick. Babies love playards and playmats , but your toddler may need something more interesting and captivating to explore. And, you\u2019ll want to keep them occupied, too. Let your little adventurer go around the house and explore their territory with our walkers, or have a fun-filled bouncey time with our jumpers. Got a little Einstein out there? Our exclusive selection of pre-school learning toys is just made for them.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 333, "catid": 4120, "level": 0, "url": "http://www.target.com/c/car-seats-baby/-/N-5xtlx", "text": "car seats", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Getting around town is even more exciting with kids. All you need is a perfect car seat to give your little travel companion the comfort she deserves. From infant car seats to convertible car seats and harness boosters, Target has a wide selection of car seats from leading brands like Baby Trend , Evenflo and Graco that are sure to offer peace of mind! Just pick your favorite, buckle up baby and hit the road! Your baby\u2019s day out gets better with our infant car seats. It has everything from a padded seat, canopy, headrest and more to keep your tiny traveler as comfy as he is at home. Some say parenting is difficult, but we say it\u2019s fun (at least when you\u2019re driving)! To make your life easier, most of our infant car seats come with a base and a seat, so you can leave the base in the car and move the seat to a stroller and just keep going! Worried about bumpy rides? Rest easier with reliable harness systems from Target! Your baby grows faster than you can imagine. He may outgrow his clothes, cribs and playards pretty fast, but not our convertible car seats! From an infant and a toddler to a kid, they are made to be a part of every phase of his childhood. And for parents, the convertible car seat is a definite bang for the buck!", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 356, "catid": 4121, "level": 0, "url": "http://www.target.com/c/strollers-baby/-/N-5xtk7", "text": "strollers", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Your baby is your world, and now it\u2019s high-time to take him out and show him the outside world. Whether it\u2019s a walk in the park or a stroll down the street, Target knows how to keep your little one comfortable. We have hundreds of baby strollers for a fun and cry-free outing. Whether for a quick pediatrician visit or grocery shopping, just take him with you in our exclusive selection of lightweight strollers. Our double strollers will keep twins inseparable, even outdoors ! Triplets? Our triple strollers are for you. Our full-size baby strollers just grow with your baby and give him the comfort he deserves every time. It has everything from padded seats and headrests to footrests and storage baskets, and what\u2019s more a cup holder to keep his favorite drink within reach. Worried about taking your child outdoors? All our modern strollers have harness systems and lockable wheels to offer fun for your baby and peace of mind for you. Why spend on an additional car seat , when we have travel systems that come with a car seat.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
