{"nr_products": 935, "catid": 4124, "level": 0, "url": "http://www.target.com/c/nursery-furniture-baby/-/N-5xtgh", "text": "nursery furniture", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Get the nursery ready even before your baby arrives. To welcome your family\u2019s newest and littlest member, you\u2019ll need a lot of things, as you can imagine. Finding the right nursery furniture can be a challenge, but not when you\u2019re at Target! Create the perfect nursery you\u2019ve always wanted to with our stylish collections. Give your baby\u2019s nursery a beautiful centerpiece with one of our cute and charming cribs. If bassinets or bedside sleepers are what you want, Target has them all in fun designs. You\u2019ll also find crib mattresses , conversion rails and more to make the place comfy for your little one. Having a baby can mean having a lot of things around, so storage is something to keep in mind. Choose from our huge section of dressers\u00a0 to organize baby clothes and essentials. A separate changing table helps keep your nursery clutter-free. But if space is a concern, you\u2019ll love practically designed baby furniture like dresser-changer combos. Target also has a wide range of baby bedding sets, glider and ottoman sets , toddler beds, travel beds and more to complete your nursery-building experience. You can browse nursery furniture by finish, which means color coordinating the room is made easy.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
