{"nr_products": 1902, "catid": 4134, "level": 0, "url": "http://www.target.com/c/feeding-baby/-/N-5xtl0", "text": "feeding", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "A healthy baby is a happy baby. Your little one will need the right amount of nutrition to play, learn and become an active toddler. And because Target knows breastfeeding is the key to good health, we bring to you an extensive collection of baby feeding accessories. From breast pumps and feeding pillows to baby bottles and highchairs , you can find everything you\u2019ll need to make meal time easy for you and your child. Target offers supplies for both breastfeeding and bottle feeding, including baby formula from top brands like Enfamil and Similac . Baby bottles, warmers and other bottle feeding accessories are also available. When you think your baby is ready for solid foods, Target is here to help you once again. Find cereals, fruit snacks, yogurt, fruit/veggie meals and more to introduce him to tasty and healthy food. Love preparing baby food at home? Our line of food processors including combination blenders, mixing pitchers, food mills and food chopper/steamers will fit the bill. Meal time is not just about food, it\u2019s also about food mess! Pick from our selection of baby bibs and burp cloths for mess-free feeding. Our highchairs and booster seats are available in super-practical designs, so your baby is happy and comfortable.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 1047, "catid": 4135, "level": 0, "url": "http://www.target.com/c/diapering-baby/-/N-5xtlp", "text": "diapering", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Keeping your baby happy and healthy is a tall order. Target is here to help. We offer everything from disposable and cloth diapers to wipes and warmers to keep your little one comfortable. Use our diaper gear, disposable diapers or go green with cloth diapers - all from top baby-friendly brands like Huggies , Pampers, Dadgear and Eddie Bauer . Our selection of diaper bag backpacks, totes , shoulder bags and more will keep you organized when you\u2019re on the go. Carry an extra change of clothes, diapers, wipes, creams and more wherever you go to keep your baby comfy. Protect your baby and keep surfaces covered with our changing pads, which are available in a variety of convenient sizes. Our changing pads are ideal for quick changes in the car, stroller or public restrooms. We offer diaper pails and refills to keep your nursery clean and odor-free. We also have other items to make diapering quick and easy for you and your little one. Pick up our diaper stackers, creams and more to keep your baby dry and diapering items handy. Shopping at Target helps make parenting a little easier.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 591, "catid": 4136, "level": 0, "url": "http://www.target.com/c/baby-bath/-/N-5xtjj", "text": "baby bath", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Bath time can be your baby\u2019s favorite time of the day with the proper preparations. Some say you develop a special bond with your little one as you talk, sing and play with the baby in the tub. If you think your little one is ready for the first bath, get your notepad and list out the things you need. Or, browse through the super fun collections of baby bath accessories available here at Target. We have a whole lot of awesome ideas for new moms to feel comfortable and in control, no matter how squirmy or jumpy your baby gets during bath. Choosing the right bath tub is the key. You\u2019ll find them in a multitude of shapes, colors and designs to meet every need. Cushioned, foldable, inflatable or musical baby bath tubs - you name it, you get it. Boost the fun factor during bath time with bath toys to keep your baby entertained in the water. Your baby can grip, squeeze and toss these bath toys and splash some water around. Target also offers a range of baskets and organizers to store all the toys in one place after bath. Other baby bath items available here include toiletries like shampoos, body wash, sanitizers, body lotion and more from all of your favorite brands. Once out of the tub, pat dry your little one with our super luxurious towels made of the softest fabrics for your baby. These towels come in bright colors and fun designs to choose from. Whether it\u2019s for the first bath or the hundredth, Target has everything you need to make bathing your child super special.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 569, "catid": 4137, "level": 0, "url": "http://www.target.com/c/health-safety-baby/-/N-5xthj", "text": "health & safety", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Motherhood is the biggest, most challenging and most rewarding job ever. At Target, we help you, take care of your MILP (most important little person) from his arrival and beyond. Our baby health and safety department has everything from baby medicine to bed rails for your little guy. Are you ready to start outfitting your home for a new baby? You'll want to have a few child proofing supplies tucked away and ready for his initial \u201cI discovered I can walk\u201d days. We have socket, corner and knob covers to keep your baby safe. Our cabinet locks, toilet seat latches and baby safety gates will keep him where you want him to stay, not the risky places he will want to explore! Baby got a boo boo? Our extensive supply of teething gel, gas drops, pain relief, cold and stuffy nose medicines will help your little one get through his crappy days with a smile. Check out our shopping cart and high chair covers to keep him comfy while protecting him from germs at public places. We've got a collection of fun, fabulous patterns to suit any d\u00e9cor or personality. Wondering what your baby is up to? Try our baby monitors From prenatal monitors to audio, video and internet Wi-fi monitors, we help you keep track of your baby\u2019s every move. Let Target be your partner in child safety. We will supply you with the tools you need to keep your baby healthy and safe!", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
