{"nr_products": 856, "catid": 4140, "level": 0, "url": "http://www.target.com/c/baby-toddler-boys-clothing/-/N-5xtjb", "text": "baby & toddler boys' clothing", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "He\u2019s a growing boy and you love to see him hit those milestones. This means you get to add each season\u2019s latest trends to his wardrobe. Here at Target, you\u2019ll find everything from onesies and playwear to suits and outerwear in styles you and your little guy are going to love. Because your little man is so active, we have a variety of clothes that keep up with him. Target has stylish swim trunks for your future award-winning swimmer, graphic tees, jeans , shorts and more for play dates, school and activities. Our comfy pajama sets are just what he\u2019ll need to end his day in snuggly comfort. Seasons change and so do his clothing needs. Stock up on cold-weather essentials like jackets, sweaters and vests for when there\u2019s a chill in the air and snow on the ground. Or pick up swim suits, sunglasses and tees for warm-weather wear. If you love to dress your toddler in superhero tees or button-down shirts , we have them both. From the basics to the latest, we have exactly what your little boy\u2019s wardrobe needs to be ready for any occasion. Get all this and more from top brands like Circo, Just One You by Carter's and Cherokee. Our cute, cool fashions will keep his wardrobe fresh and functional as he grows up.", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
{"nr_products": 1139, "catid": 4141, "level": 0, "url": "http://www.target.com/c/baby-toddler-girls-clothing/-/N-5xtig", "text": "baby & toddler girls' clothing", "department_url": "http://www.target.com/c/baby/-/N-5xtly", "parent_url": "http://www.target.com/c/baby/-/N-5xtly", "description_wc": 0, "description_text": "Shopping for your daughter is one of the added perks of having a little girl. Whether she enjoys ruffles, pastels, bows and flowers or prefers overalls, t-shirts and jeans, you\u2019ll find what you need at Target. Little girls grow so quickly. If it\u2019s time to revamp her wardrobe for the upcoming season or build a new one from scratch, Target has a variety of styles, colors and fashions to keep her wardrobe fun and fresh. You\u2019ll find the nightgowns and pajamas she\u2019ll love snuggling into for bedtime and the play wear that\u2019ll keep her comfy while she\u2019s enjoying herself. Whether your little girl has just opened her eyes for the first time, is beginning to take her first steps or is on the verge of attending her first day of preschool, you\u2019ll find the right clothes to suit her needs. Wondering where to start? Almost every little girl dreams of being a Disney Princess at least once in her life. Let her walk a mile in her favorite Princesses\u2019 shoes by wearing pretty tops, dresses and more decorated with images of the enchanted princesses she adores. Who can resist Hello Kitty ? Whether your child prefers t-shirts or tutus, when she\u2019s sporting Hello Kitty wear she\u2019s sure to make a fashion statement. If you\u2019re on the hunt for the latest trends or basic wardrobe essentials, you\u2019ll find them at Target. Cute styles at sweet prices. What more do you need?", "parent_text": "baby", "parent_catid": 9, "department_text": "baby", "department_id": 3},
