{"nr_products": 4520, "catid": 4812, "level": 0, "url": "http://www.target.com/c/clothing-women/-/N-5xtcm", "text": "all clothing", "department_url": "http://www.target.com/c/women/-/N-5xtd3", "parent_url": "http://www.target.com/c/women/-/N-5xtd3", "description_wc": 0, "description_text": "Thinking about revamping your wardrobe? We know you love to shop \u2018til you drop. Shop at Target to stnag awesome finds in women\u2019s clothing. You\u2019ll find incredible selections with ease in everything from accessories to party dresses and outerwear. If you\u2019re looking to work up a sweat at the gym, running track, or just want to look cute in comfort, check out our women\u2019s activewear . There\u2019s a huge collection of women\u2019s long and short sleeved tops, pants, capris and shorts, shoes, sports bras and athletic socks to choose from. Did you know it was unacceptable for women to wear pants for exercising until bloomers were invented by Amelia Bloomer in the 1890s? Can you imagine working out in a floor length dress and corset? The women\u2019s sleepwear collection will have you counting sheep in no time. We offer sleep bottoms, shirts, gowns and rompers... to name a few. They are cozy, they are snugly and they are heaven! Swimwear isn't just for summer. You'll find fabulous whiplash-making one-piece suits, bikinis, separates and cover-ups. Watch out fellas! Wardrobe essentials like jeans , casual pants or dress slacks, and skirts can be found in both the trendiest styles and classics. Pair them up with ultra cool women\u2019s tops and sweaters and finish them off with blazers and jackets to stay warm and chic. Start updating your wardrobe with the season\u2019s latest. Variety and style are just a click away. We have what you're looking for at Target.", "parent_text": "women", "parent_catid": 1, "department_text": "women", "department_id": 1},
