{"nr_products": 602, "catid": 4856, "level": -1, "url": "http://www.target.com/c/intimates-clothing-women/-/N-5xtcf", "text": "intimates", "department_url": "http://www.target.com/c/women/-/N-5xtd3", "parent_url": "http://www.target.com/c/clothing-women/-/N-5xtcm", "description_wc": 0, "description_text": "Look good under, feel good all day! That's the mantra we follow when it comes to lingerie! It'll be your secret (unless you care to share) that you're wearing intimates you absolutely adore. From Self Expressions by Maidenform to Simply Perfect by Warner's, when you go through our fabulous collections, you'll see what we mean! For flirtatious, fun and fashionable women's intimates, shop at Target. The Gilligan & O'Malley embroidered separates are perfect for a weekend getaway with your Mr. Wonderful. For a little boost in size and definition, try out our collection of gel and padded bras . For younger ladies, daily and sports training bras are available as they transition to other varieties. Target is also your one stop shop for everything in basics, from classic brands such as Hanes. If you want a new silhouette, our body slimming shape wear is a godsend. Give extra ooh-la-la to your assets with intimate's accessories like push up pads and reusable petals. Select from tanks or camis to wear under sheer tops or v-necks. Oh! And you dress and skirt lovers - don't forget the slips ! Our maternity and nursing wear will keep you comfy for nine months and beyond. Whatever your style, our colorful collection of women's panties in a variety of prints and patterns will keep you coming back for more! Worried about VPL (visible panty lines) a phrase popularized by the 1977 movie Annie Hall? Our seamless panty collection will help you avoid this fashion faux-pas. Take a look at our figure flattering women's intimates from lacy to racy, all in one store at Target. You'll be thrilled with all we have to offer!", "parent_text": "all clothing", "parent_catid": 4812, "department_text": "women", "department_id": 1},
